myData = [
[48.243907941402,16.390584744984, 'Skinri(p)er, 6B+, Stonewalls', 'http://www.urban-boulder.com/de/node/31398', 'Skinri(p)er', '6B+', 'Kleingriffiger Boulder mit Musterzügen', 'Ohne Fugen, Start rechte Granitkante, Übergriff, Top obere Kante', 'Stonewalls', 1],
[48.167110753661,16.413431739088, '#supersafe 6b, 6B, Buildings', 'http://www.urban-boulder.com/de/node/31397', '#supersafe 6b', '6B', 'No description', 'No rules', 'Buildings', 5],
[48.242149773477,16.386770153581, 'Frühlingsgefühle, 5B, Stonewalls', 'http://www.urban-boulder.com/de/node/31396', 'Frühlingsgefühle', '5B', 'Handelskai ...  \n Bewertung: Fontainebleau Fb 5b ...  \n Erstbegehung: Geile Klettertruppe Wien', 'Sitzstart. Keine Rillen zwischen den Platten, sonst alles steigen, siehe Topo.', 'Stonewalls', 1],
[48.242131894014,16.386677738311, 'Pika Pika , 63, Stonewalls', 'http://www.urban-boulder.com/de/node/31395', 'Pika Pika ', '63', 'Handelskai ...  \n Bewertung: Fontainebleau Fb 6a ...  \n Erstbegehung: Geile Klettertruppe Wien', 'Keine Rillen zwischen den Platten, sonst alles steigen, siehe Topo.', 'Stonewalls', 1],
[48.230202716071,16.412299750957, 'Parkoulder, 6B, Fun Stuff', 'http://www.urban-boulder.com/de/node/31394', 'Parkoulder', '6B', 'No description', 'No rules', 'Fun Stuff', 5],
[48.247088976972,16.395271469866, 'Hangelkante, 6B, Training', 'http://www.urban-boulder.com/de/node/31393', 'Hangelkante', '6B', 'With a sitstart it might be around 6c if you hang low on the edge. it is fun but also a bit artificially harder than it needs to be.', 'Only use the edge as a foothold (no foothols below). Do not hang with your forearms or armpits on the edge, which makes it easier and much uglier as well.', 'Training', 4],
[48.25038950482,16.397372866895, 'Rambazamba, 7B, Other Stuff', 'http://www.urban-boulder.com/de/node/31392', 'Rambazamba', '7B', 'Starts between the 2 concrete walls, then use the good but somewhat slopy one finger pockets (and everything else you can hold on to) to traverse to the right. Top would be the stonepart of the bridge on the right. Couldn \' t do it, seems really hard. fb 7b? harder?', 'press between the 2 walls to start (standing). *without the metal door *without the top part of the wall.', 'Other Stuff', 5],
[48.255400852482,16.400465855431, 'Zechenkas, 6C, Cracks', 'http://www.urban-boulder.com/node/31391', 'Zechenkas', '6C', 'other similar boulders but with slightly narrower cracks could be far harder or easier, depending on the size of your fingers. fb 6a+ maybe', 'NO TOPOUT. Entering the roof is forbidden. ;-)', 'Cracks', 4],
[48.257952586906,16.401297405698, 'DER Kühlschrank, 6C, Stonewalls', 'http://www.urban-boulder.com/node/31390', 'DER Kühlschrank', '6C', 'very nice and rather fridge like boulder. fb 6a+', 'rather high, spotting adviced.', 'Stonewalls', 3],
[48.257904904416,16.401234029362, ' Bröselverschneidung, 6C, Stonewalls', 'http://www.urban-boulder.com/node/31389', ' Bröselverschneidung', '6C', 'Climb up the corner, climb up to the metalbeam or up to the ledge, depending on how confident you feel. The same boulder can be found 100 m south, where there are no cars parked behind. fb ~6bish', 'bring good shoes -&gt; Tiny, crumbly footholds.', 'Stonewalls', 3],
[48.18461836646,16.334686428308, 'Betonfreunde, 4, Sculptures', 'http://www.urban-boulder.com/de/node/31388', 'Betonfreunde', '4', 'Zwischen den beiden Aufghängen der U4 Station Längenfeldgasse gibt es eine nette Boulderanlage im Freien. Die Betonskulpturen bieten abwechslungsreiche Bouldermöglichkeiten. Es gibt leider keine farbreinen Routen, aber mit ein bisschen Phantasie kann man sich ganz gute Routen zusammenstöpseln. Sehr sonnig- aber auch ziemlich laut...', 'Die Boulderrouten einfach selbst definieren...', 'Sculptures', 5],
[42.449561251137,18.53657618165, 'To the cactus, 5A, Fun Stuff', 'http://www.urban-boulder.com/cactus', 'To the cactus', '5A', 'It is a fun climb involving food, get the prickly pears using the wall!', 'Every grips on the wall are allowed, watch the cactus spikes though and good appetit!', 'Fun Stuff', 2],
[43.577140292556,7.1259440481663, 'Jeux interdits, 4, Buildings', 'http://www.urban-boulder.com/fr/node/31386', 'Jeux interdits', '4', 'Jeux interdits se situe sur la corniche du rempart, à ne pas refaire bien évidemment!', 'Utiliser la corniche en crochettant avec les pieds pour faire la traversée.', 'Buildings', 2],
[48.228567233783,16.395765691996, 'Baumstamm-Mikado, 5A, No type', 'http://www.urban-boulder.com/de/node/31385', 'Baumstamm-Mikado', '5A', 'Eine Aufwärmroute für den Urban Boulder Cup 2017 die den ganzen Körper in Schwung bringt.', 'Die Skulptur entlang der Markierung im Hangl-Stil entlangklettern. Bei den Klimmzugstangen wird es für große Leute etwas eng. :-) Der Ausstieg ist unter dem letzten Baumstamm sehr knapp über dem Boden. Viel Spaß!', 'No type', 1],
[48.237200093125,16.402224451303, 'Brigittenauer Bucht, 6C, No type', 'http://www.urban-boulder.com/de/brigittenauer-bucht', 'Brigittenauer Bucht', '6C', 'Hier findet das Finale des Urban Boulder Cups 2017 statt- und danach eine hoffentlich gemütliche Party!', '...werden noch nicht verraten. :-)', 'No type', 4],
[48.212415321056,16.384081989527, 'Crack-it, 6B, No type', 'http://www.urban-boulder.com/de/node/31382', 'Crack-it', '6B', 'Ein interessanter Riss an der Uraniawand. Ein guter Einstiegsriss, da er nicht besonders hoch ist.', 'Greifen und steigen nur die vertikalen Risse!', 'No type', 2],
[48.212301574921,16.383454352617, 'Runde-ohne-Ende, 6B, No type', 'http://www.urban-boulder.com/de/node/31381', 'Runde-ohne-Ende', '6B', 'Eine technisch anspruchsvolle Route an der bis jetzt noch recht griffigen Uraniawand.', 'Greifen nur die markierten Griffe, steigen alles erlaubt!', 'No type', 1],
[48.242284700842,16.386817842722, 'Homo-Brachialis, 6B, No type', 'http://www.urban-boulder.com/de/node/31380', 'Homo-Brachialis', '6B', 'Eine sehr lange und stets überhängende Stahl-Tour am Handelskai. Der Schlüsselzug ist ganz zum Schluss- daher immer gut mit Crashpads sichern und spotten!', 'Der Start ist direkt unter dem Fußgängersteg. Man steigt auf die Brüstung (Achtung- hier geht es gut 8m runter zum Treppelweg!) und hangelt sich an der ca. 5cm breiten Stahlkante zum ansatz des runden Längsträgers. Dort kommt ein tricky Übergang zu den ausgeschnittenen Löchern im stehenden Stahlträger direkt unter dem Stahlblech. Am besten man zieht zuerst hoch zum Hauptträger und lehnt sich dann raus- das runde Profil ist leider nicht sehr griffig. Wenn man einmal im Überhang ist geht es recht einfach hinaus zum Rand. Dort wartet die Crux in Form eines weiten und kraftigen Zuges hinauf zum Top. Viel Spaß!', 'No type', 1],
[48.212288936446,16.383314877748, 'Poledance, 5A, No type', 'http://www.urban-boulder.com/de/node/31379', 'Poledance', '5A', 'Eine witzige Aufwärm-Route unter der Aspernbrücke.', 'Vom Start bis zum Top traversieren und hinter dem Laternenmast vorbeiklettern. Wichtig dabei: immer lächeln! ;-)', 'No type', 1],
[48.228600083364,16.395653039217, 'Weitreichende Geschehnisse, 6B, No type', 'http://www.urban-boulder.com/de/node/31378', 'Weitreichende Geschehnisse', '6B', 'Eine weitere, sehr elegante Route an der Betonwand am Nordbahnhof-Viertel. Weite Seitzüge werden mit einem tricky Move in die Endposition belohnt. Viel Spaß!', 'Greifen nur die markierten Griffe. Steigen nur Beton!', 'No type', 2],
[48.228627879147,16.395679861307, 'Saftpresse, 6C/6C+, No type', 'http://www.urban-boulder.com/de/node/31377', 'Saftpresse', '6C/6C+', 'Die Saftpresse ist ebenfalls Teil des Urban Boulder Cup 2017. Hier heißt es pressen was das Zeug hält!', 'Es sind nur die markierten Seitgriffe erlaubt. Steigen nur die Betonstruktur. An den Seitgriffen arbeitet man sich langsam hoch bis man mit viel Schwung zum Top hochziehen kann.', 'No type', 2],
[48.228643040477,16.395658403635, 'Kinn-first, 6C, No type', 'http://www.urban-boulder.com/de/node/31376', 'Kinn-first', '6C', 'Kinn-first ist bei den Vorbereitungen für den Urban Boulder Cup 2017 entstanden. Wer den letzten Zug gemacht hat weiß woher der Name stammt. ;-)', 'Greifen nur die markierten Betonleisten. Steigen nur die Betonstrukturen. Zum Top am besten mit viel Schwung!', 'No type', 2],
[48.227425824213,16.411317139864, 'Schallochstemmer, 6B, Cracks', 'http://www.urban-boulder.com/de/node/31375', 'Schallochstemmer', '6B', 'Die Route befindet sich direkt neben der Route "Einer flog über das Schwalbennest". Der Einstieg in der Verschneidung ist ganz schön tricky- gezielt Ansteigen und mit etwas Schwung hoch zur Betonkante. Dann im Piazstil rauf zum runden Top. Ganz schön kraftig!', 'Einstieg direkt in der Verschneidung. In der Verschneidung hoch bis zum Geländer.', 'Cracks', 5],
[48.212387516468,16.383904963732, 'Gecko, 6B, No type', 'http://www.urban-boulder.com/de/node/31374', 'Gecko', '6B', 'Eine feine, kleingriffige Route am Donaukanal, direkt gegenüber der Urania! Am beste mit Crashpad- die Route ist ganz schön hoch!', 'Die kleinen Leisten herzwicken und durch bis zur Kante. Nur die markierten Griffe, Steigen alles.', 'No type', 1],
[48.204056329549,16.235836297274, 'Wiener Pforte, 5A, Stonewalls', 'http://www.urban-boulder.com/de/node/31373', 'Wiener Pforte', '5A', 'Diese Route verläuft entlang der Pfeilerkante der Brücke bis nach oben. Die Kletterei ist nicht besonders schwer- trotzdem sollte man unbedingt aufpassen, da das Absprunggelände sehr abschüssig ist!', 'An der Kante bis nach Oben. Alles erlaubt.', 'Stonewalls', 3],
[48.742503022064,15.670523196459, 'No-Hand-Pole, 5A, Fun Stuff', 'http://www.urban-boulder.com/de/node/31372', 'No-Hand-Pole', '5A', 'Ein kleiner Betonpfeiler bei der Bahnstation Hötzelsdorf im Wald4tel zum Zeitvertreib während man auf den Zug wartet!', 'Ohne Hände bis man ganz oben steht- und wieder absteigen. Gute Gleichgewichtsübung!', 'Fun Stuff', 1],
[48.225378197147,16.375574022532, 'AugartenBaum, 4, Trees', 'http://www.urban-boulder.com/de/node/31371', 'AugartenBaum', '4', 'Ein toller Aufleger-Kletterbaum für Jung und Alt im Augarten!', 'Einfach rauf und wieder runter- dann der/die Nächste!', 'Trees', 1],
[48.239659843825,16.364163905382, 'Nasenbogen, 6C/6C+, Stonewalls', 'http://www.urban-boulder.com/de/node/31370', 'Nasenbogen', '6C/6C+', 'Eine hohe und anspruchsvolle Tour über den Bogen den Brückenportals des Döblinger Stegs. Achtung: sehr hohe Route! Unbedingt mit Crashpad klettern und spotten!', 'Von links nach rechts oder von rechts nach links- Krux in der bitte am höchsten Punkt.', 'Stonewalls', 1],
[48.23976952403,16.36381521821, 'Unten durch, 6C, Pure Steel', 'http://www.urban-boulder.com/de/node/31369', 'Unten durch', '6C', 'Eine der spektakulärsten und luftigsten Urban Boulder Routen in Wien! Die Route führt vom sicheren Geländer hinunter auf die dunkle Unterseite des Döblinger Stegs. Man klettert an durchwegs guten Griffen auf die andere Seite und mit ein paar kräftigen Zügen wieder hinauf ins Licht. Diese Route garantiert Gänsehaut- ist aber eigentlich nicht besonders schwierig- ca. UIAA 6.', 'Von einer Seite zu anderen entlang der Stahlträger. Unbedingt dort Klettern wo das Wasser tief genug ist!', 'Pure Steel', 1],
[48.232709399617,16.361057907343, 'Urban-West-Verschneidung, 6B, Stonewalls', 'http://www.urban-boulder.com/node/31368', 'Urban-West-Verschneidung', '6B', 'A very elegant and high route on the Pier9 Playground. It is the same bow like the Route Mama. But here the holds are defined- and the top out is at the top! take care about the steel sheet at the top. it is not too stable. always wth crashpads and friends who are spotting!', 'Only use the marked holds! Not using the first step on the steel sheet makes the first move much harder!', 'Stonewalls', 5],
[48.232713189647,16.361127644777, 'Mama, 6B, No type', 'http://www.urban-boulder.com/node/31367', 'Mama', '6B', 'Mama is a very cool traverse over the first arch after the walk-threw at spittelau, donaukanal. Take care- the climbing down is not that easy. Crashpad necessary!', 'Start on one of the two pillars and climb up the arch until you reach the stone in the middle. Here you can rest a little bit. Climbing down, especially on the right side is a bit tricky.', 'No type', 2],
[48.233790810438,16.360864788294, 'Bullen, 6C, Buildings', 'http://www.urban-boulder.com/node/31366', 'Bullen', '6C', 'A nice traverse in a very scenery ambiente close to the Donaukanal and Spittelau in Vienna. The joints are prette small- so prepare your fingers. For Andrea Maruna no problem at all! :-)', 'no rules.', 'Buildings', 5],
[48.242081061866,16.386667639017, 'Chin up!, 6C, No type', 'http://www.urban-boulder.com/node/31365', 'Chin up!', '6C', 'This route is a nice up and down traverse on the famouse Handelskai-Granit-Walls. Threw its legth you need quite a bit of endurance, so chin up and climb threw it!', 'This route can be done either from the right or from the left side. It is a little bit harder starting from the left side.', 'No type', 4],
[48.242131078423,16.386597901583, 'Duftbaum-Traverse, 6C, No type', 'http://www.urban-boulder.com/de/node/31364', 'Duftbaum-Traverse', '6C', 'Ein neu merkierter Boulder in der Duftbaum-Kurve am Handelskai!', 'Start am linken Rand der gebogenen Wand an den Fugen- Ende am rechten Ende, ebenfalls an den Fugen. Der Ausstieg ist besonders tricky!', 'No type', 5],
[48.26805816846,16.363482624292, 'Überhangbaum, 5A, Trees', 'http://www.urban-boulder.com/de/node/31363', 'Überhangbaum', '5A', 'Ein etwas eigenartig aussehender Baum an der Donaulände auf dem Weg zum Kahlenbergerdorf. Wenn man beim Radfahren oder Spazieren plötzlich Lust auf etwas Baumklettern bekommt, kann man dorf kurz Pause machen.', 'Wenn man im Überhängenden Teil bleibt ist der Baum ganz schön kraftig. Keine Kletterschuhe notwendig.', 'Trees', 1],
[48.242147474221,16.386774927378, 'Giuletta al balcone, 5A, No type', 'http://www.urban-boulder.com/node/31362', 'Giuletta al balcone', '5A', 'Originally the route was named "Iniziocazzo" for its strange start, but as we saw julia sitting on the top-out we found the name "Giuletta al balcone" more suitable. :-)', 'Starkt with two hands on the concrete block. From there start climbing into the wall and up to the top-out. Good footwork needed!', 'No type', 5],
[36.996876309544,-7.9773388803005, 'Footbridge, 4, Fun Stuff', 'http://www.urban-boulder.com/node/31361', 'Footbridge', '4', 'Back from the surfing class, just hang yourself at the footbridge! No climbing shoes needed.', 'Traverse one or two sections of the bridge!', 'Fun Stuff', 5],
[48.230063,16.412393, 'Pudel Linie, 6C/6C+, Power Boulder', 'http://www.urban-boulder.com/de/boulderroute/pudel-linie', 'Pudel Linie', '6C/6C+', 'Donauinsel side, below Reichbrücke, Donauinsel U-bahn stop and 100m straight ahead. ...  \n Nice and hard line with compression and toe jamming than a slopy topout.', 'Standstart, use anything except the little wall on the right (about 1.5m high, don \' t step on it...) ...  \n Think it would be fair for a FB 7a.', 'Power Boulder', 5],
[48.231754,16.410271, 'Ungarische Astronaut, 6C, Power Boulder', 'http://www.urban-boulder.com/de/boulderroute/ungarische-astronaut', 'Ungarische Astronaut', '6C', 'Really fun dyno on a mostly blank wall! ...  \n Under "Reichsbrücke" on the Donauinsel side, go upstream about 400m, not directly at the Donau, a bit above the bright blue wall.', 'Start with your feet high on the metall thing sticking out from the wall and the wooden doorframe for your hand. Reach the 2 lines, use the small circles for feet and dyno to the top :) ...  \n FB 6B ish, if you are 180cm or so...', 'Power Boulder', 2],
[48.22326,16.420821, 'Big-O (Riss illuison), 6B, Cracks', 'http://www.urban-boulder.com/de/boulderroute/big-o-riss-illuison', 'Big-O (Riss illuison)', '6B', 'Nice compression line with some toe jamming involved. Right under "Kaisermühlen Brücke" on the Donauinsel side, easy to spot.', 'Start from the big screwhead that sticks out for your feet, use the sidewall for right hand and the lines for left hand. Pull together and get up... could be a FB 6B or 6C I guess. ...  \n A sitstart  without the out sticking screwhead also possible, but hard :)', 'Cracks', 3],
[48.315252,14.297884, '8-ball, 6B, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/8-ball', '8-ball', '6B', 'Die Abschlussroute von The Crux 2013 nochmal zum richtig auspowern in der Nähe der Eisenbahnbrücke in Linz.', 'Von links nach rechts sich ganz in Ruhe die Unterarme aufpumpen. Schöne Traverse!', 'Stonewalls', 5],
[48.31378,14.294814, 'Bara aua, 5A, Sculptures', 'http://www.urban-boulder.com/de/boulderroute/bara-aua', 'Bara aua', '5A', 'Noch eine tolle Kletter-Skulptur im Skulpturenpark am Donauufer in Linz. Beim Absprung von der Skulptur  ist Bara beim The Crux 2013 leider umgeknöchelt- daher auch der Name. Es musste sogar sie Rettung kommen. Hoffentlich kann er schon wieder klettern! Gute Besserung!', 'Die Skulptur wird von der Hinterseite in Kokospalmenstil bestiegen. Dazu sind griffige Schuhe mit weichem Gummi von Vorteil. Oben schiebt man sich auf den anderen Teil der Skulptur. Von dort kann man die steile Fläche ganz gut herunter rutschen.', 'Sculptures', 5],
[48.309977,14.290869, 'Sitzstart, 5A, Sculptures', 'http://www.urban-boulder.com/de/boulderroute/sitzstart', 'Sitzstart', '5A', 'Ein weiterer ausgefallener Boulder direkt neben dem Wellenreiter am Donauufer in Linz', 'Sitzstart, mit den Beinen gscheit verspreizen und die rutschige Stahlfläche hocharbeiten. Der Boulder ist zwar kurz aber recht gefinkelt.', 'Sculptures', 4],
[48.309982,14.290893, 'Wellenreiter, 5A, Sculptures', 'http://www.urban-boulder.com/de/boulderroute/wellenreiter', 'Wellenreiter', '5A', 'Eine recht hohe und rutschige Stahlskulptur im Skulpturenpark am Donauufer.', 'Besser nicht abrutschen und wirklich gut spotten! Das Absprunggelände ist wirklich ungemütlich!', 'Sculptures', 5],
[48.309152,14.283731, 'SO-Kante, 6C/6C+, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/so-kante', 'SO-Kante', '6C/6C+', 'Die SO-Kante ist gleich links neben der SO-Verschneidung. Mit der rechten Hand an der Kante gehts auf kleinsten Griffen nach oben. Beim "The Crux" 2013 hat diese Route niemand geschafft. Kein einfaches Ding!', 'Rechte Hand an der Kante, man klettert an der linken Seite hoch.', 'Stonewalls', 2],
[48.309205,14.2837, 'SO-Verschneidung, 6B, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/so-verschneidung', 'SO-Verschneidung', '6B', 'Die Südost-Verschneidung ist eine knallharte Verschneidung bei der man besser seine Reibungsschuhe zu Hause lassen sollte, denn es geht auf winzigen Leisten hoch zum ca. 4m hohen Ausstieg.', 'Sauber steigen, Jungs und Mädels!', 'Stonewalls', 5],
[48.309218,14.283742, '4 gewinnt, 5A, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/4-gewinnt', '4 gewinnt', '5A', 'Ein kurzer, dafür aber recht verzwickter Boulder bei dem man aus einem der vier Türen heraus starten. Mittels Kamintechnik muss man recht hoch ansteigen um dann zum Lüftungsgitter hochzugreifen.', 'nichts spezielles...:-)', 'Stonewalls', 2],
[48.3091,14.283472, '2 gewinnt, 5A, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/2-gewinnt', '2 gewinnt', '5A', 'Um die Laternenmasten zu klettern muss man gut im Team zusammenarbeiten. Den Einstieg macht man per Räuberleiter, den Rest muss man dann alleine machen. Die Kletterei ist nicht besonders schwer, aber doch recht moralisch. Zwischendurch muss man ein bisschen auf Reibung klettern. Große Leute haben bei dieser Route sicher einen Vorteil, weil man leichter zum nächsten Stahlring kommt.', 'Räuberleiter und gerade rauf! NIcht ohne Crashpad!', 'Pure Steel', 5],
[48.309228,14.283801, 'TussiRiss, 6B, Cracks', 'http://www.urban-boulder.com/de/boulderroute/tussiriss', 'TussiRiss', '6B', 'Ein recht ruppiger Riss, nur mäßig für Tussis geeignet. Wegen der Höhe wurde der Crack beim "The Crux" auf ca. 5m beschränkt wurde. Ein Durchstieg wurde nicht gemacht- könnte aber möglich sein, wenn auch sehr hoch (ca. 8m) und mit mulmigen Ausstieg. Nicht ohne Crashpad einsteigen!', 'mhhh...so weit rauf wie möglich.', 'Cracks', 5],
[48.308949,14.283136, 'Turm der Schmächtigen, 4, Sculptures', 'http://www.urban-boulder.com/de/boulderroute/turm-der-schm%C3%A4chtigen', 'Turm der Schmächtigen', '4', 'Eine recht einfach zu kletternde aber doch recht hohe Skulptur direkt am Donauufer neben dem Ars Electronica Center.', 'Mit oder ohne Schuh- einfach rauf...', 'Sculptures', 5],
[48.305585,14.287022, 'Benchboulder - The Crux Linz, 4, Fun Stuff', 'http://www.urban-boulder.com/de/boulderroute/benchboulder-crux-linz', 'Benchboulder - The Crux Linz', '4', 'Der Einstiegsboulder vom "The Crux " in Linz am 15.6.2013. Eine tolle Veranstaltung! Fotos und Infos findet man hier: the-crux.at', 'Einmal rund um die Bierbank ohne den Boden zu berühren.', 'Fun Stuff', 5],
[48.228932,16.411042, 'Reichsbrückenpfeiler, 5A, DWS', 'http://www.urban-boulder.com/de/boulderroute/reichsbr%C3%BCckenpfeiler', 'Reichsbrückenpfeiler', '5A', 'Direkt bei der U1 Station Donauinsel kann man mit gutem Blick auf die Copa Cagrana in Ruhe über dem Wasser der Neuen Donau Bouldern. Entweder man borgt sich ein Tret- oder Elektroboot bei der nahe gelegenen Booteria aus, oder man schwimmt ganz einfach zum Preiler- denn nass wird man sowieso. Das Wasser ist bei normalem Pegelstand auch ausreichend tief um ohne Probleme auch von ganz oben abspringen zu können. Auf dem der Donauinsel näher gelegenen Pfeiler hat der Urban Waters Cup 2013 stattgefunden (Fotos by Johannes Marschick und Sebastian Wahlhütter). ... ', 'Kletterschuhe empfolen, aufpassen wenn man über einem Boot klettert, Crashpad nicht notwendig...', 'DWS', 5],
[48.222347,16.435978, 'Selbstverständlich, 5A, DWS', 'http://www.urban-boulder.com/de/boulderroute/selbstverst%C3%A4ndlich', 'Selbstverständlich', '5A', 'Ein neuer Urban Boulder Spot für die heißen Sommertage in Wien vor dem Strandbeisl Selbstverständlich an der alten Donau. Je nach Lust und Laune klettert man seine Runden oder mantelt auf die Plattform. Wenns einem zu viel wird, bietet das Wasser angenehme Abkühlung.', 'Die Badegäste beim hochklettern bitte nicht schrecken! :-)', 'DWS', 5],
[48.228629,16.395714, 'Kletterwand im Zweiten, 4, Training', 'http://www.urban-boulder.com/de/boulderroute/kletterwand-im-zweiten', 'Kletterwand im Zweiten', '4', 'Es gibt eine neue Trainingswand im zweiten Bezirk! Die Wand hat neben den Plastikgriffen auch Betonausnehmungen. Damit kann man sich schon ganz nette Boulder zusammenbasteln. Außerdem gibt es einen guten Fallschutz mit Schotter. Es wurden auch schon erste Markierungen von Boulderern gesichtet...:-)', 'Es sind verschiedene Variationen möglich: Hände nur Betonstrukturen - Tritte nur Griffe, usw...', 'Training', 3],
[48.321312,14.296829, 'Der Rostgitter Sprung, 2+, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/der-rostgitter-sprung', 'Der Rostgitter Sprung', '2+', 'Start: gelber Graffiti-Schriftzug ...  \n Ende: Eisengitter unter der Brücke ...  \n Griffe: Je höher desto kleiner ...  \n Abklettern: Nur schwer möglich ...  \n Absprung: Kurze Airtime aber OK', 'keine', 'Stonewalls', 1],
[47.830098,16.048703, 'Skywalk - Hohe Wand, 6B, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/skywalk-hohe-wand', 'Skywalk - Hohe Wand', '6B', 'Am besten über die Route Zukunftsweiser in der Sonnenuhrwand (Hohen Wand) gelangt man zum recht luftigen Ausstieg auf den Skywalk. Wenn die Knochen schon recht müde sind, freut man sich besonders, wenn man wieder richtigen Stahl unter den Fingern hat. Danke Florian Thamer für die tolle Tour! Das nächste Mal zeige ich dir ein paar tolle Ausstiege auf der Flexwand! :-) ...  \n <a href="http://www.thamer.at">www.thamer.at</a>', 'Keinen Mist vom Skywalk werfen!', 'Pure Steel', 5],
[48.242234,16.386643, 'Alles klar Herr Kommissar, 4, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/alles-klar-herr-kommissar', 'Alles klar Herr Kommissar', '4', 'Eine neue, feine Route an den guten alten Handelskai-Wänden. Nur als Tipp: Der Polizei das Crashpad als Massagematte zu verkaufen funktioniert nicht. Aber keine Panik- Polizisten sind auch oft Kletterer...', 'Zuerst zum rechten großen Block hochklettern, dann nach links zum zweiten großen Block an der Wand traversieren. Zum Abschluss dann noch das Ganze abklettern. Die Runde fordert trotz der relativ guten Griffe ein gutes Maß an Ausdauer. Trotz der nicht all zu großen Höhe unbedingt mit Crashpad klettern!', 'Stonewalls', 2],
[48.212385,16.383731, 'Urania-Verschneidung, 5A, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/urania-verschneidung', 'Urania-Verschneidung', '5A', 'Eine der ersten Routen des Urban Boulder Cup 2011. Eine nicht sehr hohe, dafür aber sehr knifflige Verschneidung beim Stiegenabgang gegenüber der Urania.', 'Schön in der Verschneidung bleiben und über den linken, hohen Block aussteigen. Crashpad wärmstens empfohlen!', 'Stonewalls', 3],
[48.221308,16.334216, 'Dornerplatz, 5A, Sculptures', 'http://www.urban-boulder.com/de/boulderroute/dornerplatz', 'Dornerplatz', '5A', 'Habe diese tolle Kletterskulptur am Dornerplatz (nähe Elterleinplatz) im 17. Bezirk entdeckt. Sobald das Wetter besser ist gehts ihr an den Kragen! :-)', 'Das Pickerl möglichst weit oben anbringen!', 'Sculptures', 3],
[48.227477,16.411314, 'Einer flog über das Schwalbennest, 6C/6C+, Cracks', 'http://www.urban-boulder.com/de/boulderroute/einer-flog-%C3%BCber-das-schwalbennest', 'Einer flog über das Schwalbennest', '6C/6C+', 'Weil es wieder einmal viel zu heiß zum klettern war, war ein ausgiebiger Badetag an der Neuen Donau die einzig wahre Alternative. Und siehe da, eine neue knackige Boulderroute wurde entdeckt! Einen Radler für denjenigen, der als erstes ein Pickerl oben anbringt ohne die Schwalben bei ihrer Nestbauaktivität zu stören!', 'Unter der Brücke zum Auflager hochschringen- dann seitlich zur hinterschnittenen Außenkante der Brücke traversieren. Mit elegantem Foot-Hook bis zur ersten offenen Fuge rausklettern. Dort ist dann die Crux daheim. Um zum Gekländer hochzukommen muss man den Riss irgendwie hochpiazen. Viel Spaß! :-)', 'Cracks', 5],
[48.218867,16.370792, 'INRI, 6C/6C+, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/inri', 'INRI', '6C/6C+', 'Eine seht knackige, neue Route an der Flexwand die meines Wissens nach noch niemand beim ersten Vesuch geschafft hat. Gestartet wird an einem Aufleger mit Links, links unterhalb des ersten Seitgriffs. Dann gehts von diesem Seitgriff zum anderen nach links hinüber bis man sich in den linken Griff reinhängen kann. Zum Schluss kommt noch ein Zug auf einen Zwischengriff- Ausstieg bei der Kante.', 'Sauber Gewicht verlagern! Fotos by Alois Gstöttner', 'Stonewalls', 5],
[48.243912,16.390582, 'Jump Around, 6B, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/jump-around', 'Jump Around', '6B', 'Die Finalroute vom Urban Boulder Cup 2012. Matthias Rausch hat das Finale vor Matthias Sepin und Bernhard Steindler gewonnen.', 'Der Dynamo wird von einer immer niedrigeren Fuge aus gemacht, bis nur mehr einer überbleibt der ihn schafft.', 'Stonewalls', 5],
[48.243874,16.390505, 'Down Under, 6C, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/down-under', 'Down Under', '6C', 'Die Finalroute der Damen und der Jugend beim Urban Boulder Cup 2012. Kleingriffig, technisch und ausdauernd!', 'Vom Geländer abklettern, unter der Gelb markierten Box durch und wieder hoch zur Kante.', 'Stonewalls', 5],
[48.24413,16.390045, 'Eisenbahn, 6C, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/eisenbahn', 'Eisenbahn', '6C', 'Diese Route ist ähnlich der Route Unterzughangler. Für den Urban Boulder Cup 2012 ist sie nur noch etwas verschärft worden. Die Route führte vom Betonsockel über den Stahlträger zum Bullauge. Kurz beim Bullauge ausrasten und weiter zum nächsten Ausleger, an dem man raus und hoch bis zum Geländer klettert.', 'Achtung auf die Züge beim Aussteigen! Crashpads dringend empfohlen.', 'Pure Steel', 5],
[48.242139,16.38676, 'Der (Voll-)Strecker, 6C/6C+, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/der-voll-strecker', 'Der (Voll-)Strecker', '6C/6C+', 'Diese Route war beim Urban Bouldetr Cup 2012 ein echter Aussieber. Von 18 Teilnehmern im Herren-Bewerb konnten sie nur 2 Kletterer knacken. Der Vorjahresgewinner Paul Zeiner und der Gewinner von diesem Jahr, Matthias Rausch, bezwangen diese anspruchsvolle Route beim ersten Versuch! Viel Spaß beim Nachklettern!', '2 Startgriffe, mit rechter Hand hoch auf gutmütige Leiste, dann weit nach links auf wirklich kleinen Aufleger, diesen Aufleger blockieren und mit rechts auf den weit entfernten Seitgriff schnappen, hochsteigen, eindrehn und rauf zum Top. So einfach ist das! :-)  &gt;Fotos by Karina Stromer und Martin Karrer&lt;', 'Stonewalls', 5],
[48.242128,16.386574, 'Duftbaum, 5A, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/duftbaum', 'Duftbaum', '5A', 'Ihren Namen hat die Route wirklich verdient. Leider kann man an diesem Open Air WC auch sehr gut klettern. Die Boulderwand befindet sich beim rechten Baum (von der Station aus gesehen).', 'Beim Urban Boulder Cup 2012 waren die Routen für die Mädels und Jungs unterschiedlich angelegt. Die Mädels mussten von der äußersten linken Kante bis zur rechten Kante traversieren. Die Jungs haten den selben Start, das Top war aber auf der oberen Kante, über dem der Mädels.', 'Stonewalls', 5],
[48.242261,16.386684, 'Meßstelle U6, 6C, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/me%C3%9Fstelle-u6', 'Meßstelle U6', '6C', 'Neuer Boulder am oberen Niveau vom Handelskai - direkt gegenüber vom UBahn-Ausgang unter der Trasse - rechts vom Torbogen durch den man auf die Fahrradrampe kommt: ...  \n Leiste Greifen - am Stahlträger nach oben ziehen - Kante greifen und aufstehen - nach rechts in die Wand ausspreizen - Betonleiste greifen - nach rechts in die Wand steigen - TOP', 'Rechts in der Granitwand nur Struktur steigen + greifen + Spaß haben :)', 'Stonewalls', 5],
[48.24208,16.38668, 'Bufino, 5A, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/bufino', 'Bufino', '5A', 'Kurzer Boulder oben beim Handelskai! Nett!', 'Sitzstart --&gt; Gute Leisten --&gt; Aufleger --&gt; Dynamo zum Top', 'Stonewalls', 1],
[48.242054,16.38663, 'Jupiter, 5A, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/jupiter', 'Jupiter', '5A', 'Die Plagiatsmaschinerie hat zugeschlagen: Jetzt skrupellos geklaut .. Flexwandquartett goes Handelskai:', 'Nur die markierten Griffe verwenden ... wers schafft die Karte groß genug auszudrucken um die Griffe zu erkennen :-P', 'Stonewalls', 1],
[48.242054,16.386555, 'We Apologize, 4, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/we-apologize', 'We Apologize', '4', 'Nette, kurze Route mit scharfen Leisten schräg gegenüber vom U-Bahn Eingang (Südseite). Der Einstieg befindet sich links von den schon etwas verwitterten Grafitties. Die Route geht ziemlich gerade nach oben. Ausstieg wie immer cool übers Geländer.', 'Sitzstart!', 'Stonewalls', 3],
[48.242141,16.386723, 'Granitpfeiler, 6B, No type', 'http://www.urban-boulder.com/de/boulderroute/granitpfeiler', 'Granitpfeiler', '6B', 'Beim Handelskai am oberen Niveau neben dem "Wendeltreppenboulder" und "Smells Like Kai Spirit" gibts neuerdings einen netten Boulder, der sich an der Ecke des Torbogens nach oben arbeitet. Ein paar kraftige Züge an den winzigen Leisten der Fugen und dynamisch aufs Top schnappen und man ist oben ... theoretisch!', 'Greifen und Steigen ist nur an den Fugen der großen, glatten Granitplatten erlaubt. ...  \n KEINE Granit-Struktur greifen oder steigen!', 'No type', 2],
[48.242363,16.386729, '390, 6C, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/390', '390', '6C', 'Circa 5 m hoher Boulder zwischen "Juici" und "Finnland is nice" an der guten alten Handelskai-Wand unter der Brücke. Einstieg 2 m rechts vom großen Schild. Leistenkletterei vom Feinsten mit einem fetten Aufleger in der Mitte ... so einen Griff muss man am Handelskai erst mal finden :)', 'Keine Fugen steigen oder greifen.', 'Stonewalls', 5],
[48.242173,16.386705, 'Smells Like Kai Spirit, 5A, Other Stuff', 'http://www.urban-boulder.com/de/boulderroute/smells-kai-spirit', 'Smells Like Kai Spirit', '5A', 'Über die Granit-Struktur rauf bis man zur Stahltreppe rankommt - Ausstieg wie beim Wendeltreppenboulder über das Geländer der Treppe nach oben.', 'Keine Fugen greifen oder steigen und das Crashpad nicht in die Pisse legen ;-)', 'Other Stuff', 2],
[48.230085,16.328837, 'Her Majesty, 6C, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/her-majesty', 'Her Majesty', '6C', 'aus dem Sitzstart die Verschneidung hinauf. Top nur berühren, weil es durch seine Schräge schwer zu halten ist. Crashpad empfohlen (ziemlich hoch)', 'ohne Plakatwand, sonst alles erlaubt', 'Stonewalls', 2],
[48.146687,16.402566, 'Rim, 4, Sculptures', 'http://www.urban-boulder.com/de/boulderroute/rim', 'Rim', '4', 'Naturstein; Technisch interessant. ', 'mantle it!', 'Sculptures', 1],
[48.146999,16.403115, 'Ding!, 4, Sculptures', 'http://www.urban-boulder.com/de/boulderroute/ding', 'Ding!', '4', 'Naturstein Skulptur; ...  \n interessantes Teil...', 'Ran an das Ding!', 'Sculptures', 1],
[48.146701,16.402795, 'Slippery Insider, 2+, Sculptures', 'http://www.urban-boulder.com/de/boulderroute/slippery-insider', 'Slippery Insider', '2+', 'Naturstein ...  \n teils glatt und schlüpfrig ...  \n Finden sich aber für jeden ein paar Züge.', 'Einfach austesten...', 'Sculptures', 1],
[48.147046,16.403362, 'Level up, 10, Sculptures', 'http://www.urban-boulder.com/de/boulderroute/level', 'Level up', '10', 'Coole Skulptur, einfache Züge, die Spaß machen.', 'Enjoy! ...  \n &amp; ...  \n Respect!', 'Sculptures', 1],
[48.242146,16.386823, 'Addicted to heights, 6B, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/addicted-heights', 'Addicted to heights', '6B', 'Mit einer Höhe von knapp 6 m ist "Addicted to heights" das Pendant zu Time do loko auf der gegenüber liegenden Seite der U-Bahn-Rampe. Die neue Boulder-Route ist eigentlich eine Variante von "untere Südflanke", nur das man nicht beim oberen Niveau aussteigt, sondern den Boulder konsequent gerade bis oben durchsteigt. Im oberen Drittel gibts eine knackige Stelle, wo man aus einer instabilen Position dynamisch auf den nächsten Griff weiterschnappen muss. Nett! Ausstieg elegant übers Geländer nach oben auf die Fahrradrampe.', 'Je mehr Crashpads und Spotter desto besser. Kein Sitzstart. Wer nach unten schaut is selber schuld ;-)', 'Stonewalls', 3],
[9.986518,123.369813, 'Boat-Boulder, 2, Fun Stuff', 'http://www.urban-boulder.com/de/boulderroute/boat-boulder', 'Boat-Boulder', '2', 'Gestrandestes Party-Boat am Strand in Moalboal / Cebu / Philippines beim Barefoot White Beach Resort! ...  \n Kante anspringen, bis zum Bug hangeln und nach oben mantlen. ...  \n Wie immer gilt: Zuerst bouldern und dann ins Resort feiern gehn.', 'No Belts, No Boots! ...  \n Und die erste Philippina die dich anspricht oder anlächelt ist immer ein Philippino!', 'Fun Stuff', 3],
[48.165856,16.33905, 'Wienerberg, 2+, Training', 'http://www.urban-boulder.com/de/boulderroute/wienerberg', 'Wienerberg', '2+', 'Gleich hinter dem Golfplatz bei den Basketpall- und Tennisplätzen befindet sich eine kleine Betonwandecke mit künstlichen Klettergriffen. Scheinbar wurde dort noch nicht viel geklettert, die Griffe sind noch "griffig". 3 der Tritte drehen sich leider schon.', 'Ausdauerrunden drehen ohne obere Kante ^^', 'Training', 3],
[48.200915,16.333762, 'XXXLutz-Stuhl, 6C, Fun Stuff', 'http://www.urban-boulder.com/de/boulderroute/xxxlutz-stuhl', 'XXXLutz-Stuhl', '6C', 'Das raufklettern an den Stuhlbeinen sieht einfacher aus als es ist, denn an einer Kante des Stuhlbeins gibt es immer eine Schiene für die Neonröhren, die man natürlich nicht zum Klettern verwenden darf. Dann bleibt nur mehr die Kokospalmentechnik um rauf zu kommen...:-)', 'Achtung - Privateigentum! Also nichts kaputt machen und sich nicht beim Klettern erwischen lassen!', 'Fun Stuff', 1],
[48.201795,16.337399, 'Bücherei-Hangler, 5A, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/b%C3%BCcherei-hangler', 'Bücherei-Hangler', '5A', 'Das Klettern am Urban-Loritz Platz ist etwas zwiespältig. Einerseits macht es ziemlich viel Spaß an den Stahlseilen herumzuturnen, auf der anderen Seite kommt man sich immer ein bisschen Beobachtet vor. Eh klar bei diesem Verkehr! :-) ...  \n Beim Klettern vergisst man schnell mal wie hoch oben man eigentlich schon ist. Also teilt euch die Kraft gut ein, damit ihr auch wieder herunter kommt.', 'Nur die Stahlteile benutzen. Die Stoffplanen und Blechteile sind zu sensibel zum Klettern.', 'Pure Steel', 2],
[48.200597,16.332829, 'Strukturfassade, 5A, Buildings', 'http://www.urban-boulder.com/de/boulderroute/strukturfassade', 'Strukturfassade', '5A', 'Sehr geile Beton-Strukturfassade in der Hütteldorferstraße gegenüber der Stadthalle', 'Anspringen und hochspringen oder über die Tür hochklettern. Dann traversieren bis man nicht mehr weiter weiß...:-)', 'Buildings', 4],
[48.206035,16.231517, 'Rückstaubecken, 5A, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/r%C3%BCckstaubecken', 'Rückstaubecken', '5A', 'Ein echt cooler Spot beim Wasserrückstaubecken am ende, des Asphaltierten Teil, des Wien Flusses. Empfiehlt sich denk ich mit Seil, da es passieren kann, dass man im schrägen landet wenn man Stürzt. Geht aber auch ohne :)', 'Rauf kommen - Spaß dran haben - KEINEN MÜLL HINTERLASSEN!', 'Stonewalls', 5],
[48.25467,16.455224, 'Rennbahnweg Skulptur, 5A, Sculptures', 'http://www.urban-boulder.com/de/boulderroute/rennbahnweg-skulptur', 'Rennbahnweg Skulptur', '5A', 'Eine nette Skulptur bei den Trabrenngründen.', 'Keine.', 'Sculptures', 1],
[48.194007,16.330262, 'Schmelzbrückenwanderl, 2, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/schmelzbr%C3%BCckenwanderl', 'Schmelzbrückenwanderl', '2', 'Eine kleine gemütliche 3,30m Wand an der Schmelzbrückenrampe im 15.Bezirk. Gute Einsteiger Übung. ...  \n Habs auf zwei wegen geschafft. ...  \n Kam sogar die Polizei vorbei... jedoch nicht für uns xD ...  \n Und solang man nichts kaputt macht können sie nichts machen ;) ...  \n Ab und zu überraschte Plakatierer^^', 'Es sich einfach zu machen ist ja nicht sinn der Sache ;)', 'Stonewalls', 3],
[48.187687,16.403371, 'Rinderhallen-Dachl, 5A, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/rinderhallen-dachl', 'Rinderhallen-Dachl', '5A', 'In einem neu gestalteten Park direkt vor der neu restaurierten Rinderhalle gibts diese Stahldach-Konstruktion. Nette Kletterei, weil man die Stahl-Träger überall gut greifen kann.', 'Die schönste Route ist es, wenn man den mittleren Stahlträger bis zum höchsten Punkt des Daches hinaufklettert, und sich dann mit einem eleganten Hook nach oben aufs Dach schwingt. Achtung! Die Abdeckungs-Platten sind nicht die stabilsten.', 'Pure Steel', 2],
[48.242253,16.386822, 'Juici, 6C, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/juici', 'Juici', '6C', 'Netter hoher Boulder am Handelskai ein paar Meter links von "Finnland is nice". Der Einstieg ist direkt beim Schriftzug Juici, dann gehts ein paar Meter nach rechts bis die guten Griffen kommen und dann weiter nach oben! Der Ausstieg geht wie immer elegant über das Geländer nach oben!', 'Die Griffe sind teilweise unten mit weissem und oben mit schwarzem tape markiert. ...  \n Chrashpad ist Pflicht, damit nichts passiert! Außerdem brauchts einen zweiten der unten spottet und das Crashpad bei Bedarf weiter nach rechts zieht. Der Quergang ist höher als man denkt! Viel Spaß!', 'Stonewalls', 1],
[48.084813,16.296568, 'Hangover, 4, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/hangover', 'Hangover', '4', 'eine urban route shön zu combinieren mit ein kletterausflug nach mödling. einstieg ist auf das mauerchen neben dem fluss', 'keinem top-out machen, da fahren züge herum!', 'Pure Steel', 1],
[48.193918,16.436309, 'cruxes, 6B, Power Boulder', 'http://www.urban-boulder.com/de/boulderroute/cruxes', 'cruxes', '6B', 'mann klettert hoch auf einem pfeiler, dann gehts richtung der pfeler auf der andere seite. in der mitte klettert man denn gerade auf.', 'Mit seil absichern. Es ist eine höhe brücke. aufpassen für die züge', 'Power Boulder', 1],
[48.193857,16.436244, 'Pikachu, 5A, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/pikachu', 'Pikachu', '5A', 'Eine Stahlbrückenpfeiler auf der hauptallee. oben en weitem zug.', 'Mit seil absichern. Es ist eine höhe brücke. aufpassen für die züge', 'Pure Steel', 4],
[48.203929,16.417101, 'Elephantidae, 6C/6C+, Sculptures', 'http://www.urban-boulder.com/de/boulderroute/elephantidae', 'Elephantidae', '6C/6C+', 'in einem spielplatz für kinder in der mitte vom parterpark gibt es ein betonnen platte in ein form ausgeschnitten. es gibt zwei löcher drinnen. es gibt da eine möglichkeit um daraus ein schönes project zu machen.', 'aufpassen für die kinder.  crashpad und spotten empfehlenswert. sitzstart macht das ganse viel cooler.', 'Sculptures', 1],
[48.209558,16.407054, 'where am I?, 5A, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/where-am-i-0', 'where am I?', '5A', 'Mann klettert rauf in dem eck von die 2 plakaten. Und kann die leiter benutzen um runter zu klettern. der einstieg ist das schwiergiste.', 'bouldermatte empfohlen', 'Pure Steel', 3],
[48.212618,16.399463, 'Lächelndes dachl, 5A, Fun Stuff', 'http://www.urban-boulder.com/de/boulderroute/l%C3%A4chelndes-dachl', 'Lächelndes dachl', '5A', 'Neben das skatepark im Prater gibt es ein dachl mit ein smiley drauf wo mann raufbouldern kann', 'crashpad und spotten empfohlen', 'Fun Stuff', 4],
[39.567441,2.643709, 'Palmwedel, 4, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/palmwedel', 'Palmwedel', '4', 'Naben Kulinarik- und Partytourismus setzt Palma de Mallorca immer mehr auf den neuen Tourismustrend, den Urban-Boulder-Tourismus, und schafft sich somit ein drittes Standbein im Run um die kauffreudige Kundschaft. Die Stadt bietet neben bekannten Kletterwahrzeichen wie der Stadtmauer oder antike Gemäuer auch neue Klettererlebnisse wie diese schlank gehaltene Stahlkonstruktion in zeitgenössichem Stil. Viel Spaß beim Pickerl suchen.', 'Unter der Woche Parkticket nicht vergessen!', 'Pure Steel', 3],
[48.1939,16.436148, 'Steel nerves, 6C, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/steel-nerves', 'Steel nerves', '6C', 'Fast am ende der hauptallee, ganz nah an das Lusthaus gint es eine S-bahn brucke. mann kan auf einem pfeiler rauflkettern und über einem überhang nach die andere seite von der hauptallee auf einem anderen pfeiler runterklettern.', 'Steel nerves sind ein Must, schwer abzusichern. crashpad ist das einzige das was in fall eines stürzes dir helfen kann.', 'Pure Steel', 1],
[48.189194,16.298251, 'Wienflussradweg-Senkrecht, 5A, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/wienflussradweg-senkrecht', 'Wienflussradweg-Senkrecht', '5A', 'Direkt am Beginn des Wienfluss-Radwegs zwischen den Stationen Hiezing und Braunschweiggasse ist diese markante, durch Bodenanker gehaltene Steinwand. Im linken Bereich der Wand kann man mit etwas Durchstiegswillen auf den Betonsockel steigen und sich zur Kante hoschschieben. Achtung: Die Fugen und auch teilweise die Steine sind sehr brüchig. Nur wirklich gut aussehende Griffe nehmen und niemals auf Mörtelfugen steigen.', 'Achtung: Die Radfahrer sind in diesem Bereich recht flott unterwegs. Immer brav rechts und links schaun.', 'Stonewalls', 4],
[48.177246,15.554221, 'Rosenberger St.Pölten, 5A, Sculptures', 'http://www.urban-boulder.com/de/boulderroute/rosenberger-stp%C3%B6lten', 'Rosenberger St.Pölten', '5A', 'Wer auf dem Weg nach Wien bei einer Raststation seine Finger stärken will, kann das bei der Rosenberger-Raststation vor St.Pölten tun. Die Blöcke sind ca. 5m hoch und auf einer Seite gerillt. Dadurch sind sie sehr griffig. Viel Spaß!', 'Hier gilt das salbe wie auf allen Raststations-Boulder: Vorher klettern dann Essen...:-)', 'Sculptures', 2],
[48.114678,14.666225, 'Piratenschiff, 4, Fun Stuff', 'http://www.urban-boulder.com/de/boulderroute/piratenschiff', 'Piratenschiff', '4', 'Bei der Autobahnraststation Rosenberger in Haag (A1 nach Melk in Richtung Salzburg) kann man dieses Piratenschiff entern. Achtung! Manche Schrauben sind schon länger nicht angezogen worden.', 'Vorher klettern- dann Linzer Schnitte. Nie umgekehrt! :-)', 'Fun Stuff', 3],
[48.218863,16.370812, 'Einstieg Tiefparterre, 6C/6C+, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/einstieg-tiefparterre', 'Einstieg Tiefparterre', '6C/6C+', 'Ein alternativer und sehr schöner Einstieg in die Route Tiefparterre ist dieses Schmankerl. Den Namen muss sich Berni noch überlegen.', 'Keine', 'Stonewalls', 4],
[48.218854,16.370802, 'Hughy Bear, 6C, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/hughy-bear', 'Hughy Bear', '6C', 'Ähnlich wie bei der Route "I walk the Line" sind hier nur die vertikalen Fugen erlaubt. Der Startgriff ist der selbe, nur dann geht im Umarmungs-Stil weiter nach oben. Der letzte Zug ist dann ziemlich weit.', 'Nur vertikale Fugen erlaubt. Kein Daumen-reinlegen und so...:-) Steigen alles.', 'Stonewalls', 5],
[48.218849,16.370804, 'David und Goliath, 6C/6C+, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/david-und-goliath', 'David und Goliath', '6C/6C+', 'Gleicher Sitzstart wie beim Doppeldyni. Dann gehts mit einem kleinen Seitgriff bis zum TOP.', 'Sitzstart= Sitzstart!', 'Stonewalls', 5],
[48.218772,16.370943, 'Zyklop, 6C/6C+, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/zyklop', 'Zyklop', '6C/6C+', 'Dieser echt weite Dynamo ist am glatten Wandteil der Flexwand, links vom Pfeiler direkt beim Stiegenabgang. Zyklop deshalb weil es für diese Fast 6m hohe Route nur einen großen Griff gibt von dem aus man sich zum Gesims hochschießen muss. Fotos by Mr. Chri Hoffelner. Danke!', 'Zum Erreichen vom Loch darf man die kleinen Fugen natürlich schon nehmen. Crashpad(s) oder besser Seil verwenden!', 'Stonewalls', 2],
[48.213271,16.351139, 'Shaking Balls, 6C/6C+, Sculptures', 'http://www.urban-boulder.com/de/boulderroute/shaking-balls', 'Shaking Balls', '6C/6C+', 'Ich weiß nicht wie uns so ein Schmankerl so lange nicht auffallen konnte. Danke einem Tipp von Stefan gibts einen neuen Fun-Boulder mitten im Achten. Die Shaking Balls stehen Ecke Langegasse/ Laudongasse. Der erste Eindruck: "Eh ganz lieb."- wenn man denn am Ball sitzt: "Na oida!"', 'Diese Route darf nur Free solo geklettert werden! Keine Friends oder Haken schlagen und wenn möglich auf technischen Hilfsmittel (frei nach Paul Preuß) verzichten. :-) Nur der würdige Kletterer kann die Shaking Balls erklimmen.', 'Sculptures', 5],
[48.67673,16.489663, 'Staatzer Ruine, 5A, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/staatzer-ruine', 'Staatzer Ruine', '5A', 'Kleine aber feine Felswand am großen Turm der Staatzer Ruine. Die Wand besteht aus unterschiedlichen Materialien (alten Ziegeln, schönen Sandsteinblöcken, wilden Sandsteinbrocken) und ist daher ein Erlebnis für die Finger. Geklettert wird an kleine und größeren Leisten, 1-3 Fingerlöchern und schönen Rissen. Vorsicht, aufgrund des Alters der Wand können Griffe / Tritte ausbrechen!!', 'Gibts keine. Jeder kann sich seine Boulder selber zusammenstellen - Möglichkeiten dafür gibt es genug. Nur aufpassen, dass man links oder rechts nicht runterfällt, es geht teilweise einige Meter in die Tiefe.', 'Stonewalls', 5],
[48.218873,16.370761, 'Tiefparterre, 6C/6C+, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/tiefparterre', 'Tiefparterre', '6C/6C+', 'Diese Route stellte uns bei der letzten Session vor wirkliche Probleme. Noch ist sie nicht geknackt.', 'Die Route beginnt mit den zwei Untergriffen am großen Block. Erst wenn man steht, greift man mit Links zum Aufleger am nächsten große Block hinauf. Da dieser nicht all zu viel hergibt ist man gut beraten sich bald die schräge Leiste mit der Rechten Hand zu schnappen. Dabei kippt man aber leicht aus der Wand, also immer schön das Gewicht nach links reinlegen. Zum Schluss der Schlüsselzug: Man nimmt mit der zweiten Hand die gleiche Leiste,steigt hoch an und zieht dynamisch zur Kante. Eine knallharte Mischung aus Technik und Kraft.', 'Stonewalls', 5],
[48.218831,16.370782, 'Streck dich, 6C, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/streck-dich', 'Streck dich', '6C', 'Eine weitere (nicht ganz so fingerfressende) Route ist am Markt. Mit weiten Züge gehts bis zur Schlüsselstelle. Der letzte Griff ist dann nur als Seitgriff brauchbar- reinlegen und raufziehen. Die Route wird schwieriger, wenn man senkrecht aus der Wand aussteigen möchte. Man muss dann extra nochmal nachsteigen.', 'Der letzte Griff ist nur als Seitgriff erlaubt. Sonst keine.', 'Stonewalls', 5],
[48.218847,16.370809, 'pipe is auf urlaub, 6C/6C+, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/pipe-auf-urlaub', 'pipe is auf urlaub', '6C/6C+', 'ein sehr technisches problem an kleinen leisten und seitgriffen. ob statisch oder dynamischen der letzte zug is hart. fein ausgearbeitet in so kurzer zeit.', 'bin nicht der finder dieser line deshalb gibts auch ne obl. wertung, denk die fotos zeigen euch den richtigen weg.', 'Stonewalls', 5],
[48.21878,16.370834, 'Tiefflieger, 6B, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/tiefflieger', 'Tiefflieger', '6B', 'Rechts nebem dem Dyni-Klassiker »Doppeldyni« liegt der kleine, aber nicht minder harte Bruder, der »Tiefflieger«. Er startet ebenfalls von zwei mittelprächtigen (noch kleineren) vertikalen Leisten und endet im allseits beliebten schrägen Top.', 'Keine. Einer der wenigen Dynamos, wo nicht unbedingt zwingend ein Crash-Pad nötig ist. Aber sicher ist sicher …', 'Stonewalls', 5],
[48.218768,16.371131, 'Pfeilermutti , 5A, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/pfeilermutti', 'Pfeilermutti ', '5A', 'zwischen senior und junior haben wir nun endlich das fehlende bindeglied der pfeiler familie gefunden. wie so üblich lassen einen die mütter nur selten entkommen sprich austieg gibts keinen da bleib nur der spring aufs kalte crashpad.', 'zu verwenden sind die herrlichen auflegerkanten und die leisten der kanten. zum steigen gibts genug und brav die kanten hooken. crashpad und spoter net vergessen.', 'Stonewalls', 3],
[48.19354,16.388488, 'Quatre Quart, 2, Fun Stuff', 'http://www.urban-boulder.com/de/boulderroute/quatre-quart', 'Quatre Quart', '2', 'Ein einfache Stahlstruktur zum raufklettern', 'keine sicherung ist nötig. ...  \n Respekt für die Pflanzen!', 'Fun Stuff', 4],
[48.218859,16.370793, 'Sei kreativ!, 6C, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/sei-kreativ', 'Sei kreativ!', '6C', 'Neue Route von Karoline höchst persönlich. Leider hat sie sich bei einer anderen Route den Fuße verstaucht- dashalb bin ich statt ihr die Route für die wissbegierigen Kletterer abgegengen. Muss schon sagen, eine feine Route.', 'Beim übergreifen möglichst weit unter bleiben und weit vorsteigen- dann hält man auch den nächsten Griff mit der rechten Hand. Der Ausstieg ist sehr nett wenn man das Gewicht über den rechten Fuß schiebt.', 'Stonewalls', 5],
[48.218851,16.370845, 'Keep smiling, 6B, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/keep-smiling', 'Keep smiling', '6B', 'Diese neue Flexwandroute hats in sich. Nach einem saftigen Sitzstart gehts munter mit Seitgriffen und treversenartigen Bewegungen weiter. Dum Schluss gehts vom Seitgriff dynamisch oder auch statisch (je nach Geschmack) hinauf zur Kante.', 'Wirklich ein Sitzstart- also Bopscherl am Boden...:-)', 'Stonewalls', 5],
[48.193485,16.388211, 'John Doe, 5A, Fun Stuff', 'http://www.urban-boulder.com/de/boulderroute/john-doe', 'John Doe', '5A', 'Neue Route gleich bei der S-Bahn Station Rennweg entdeckt. Dürfte eine recht anspruchsvolle Tour sein, weil man für die Füße nur die Schlungslöcher (meine Spezialität) hat, und für die Hände nur die Kante hat. Wer die Route erstbesteigt darf ihr einen Namen geben! Also immer ein Fuß nach dem anderen raufsetzen. Die Stahlkonstruktionen beim darüberliegenden Platz schaun auch interessant aus.', 'Dan Betonblock mit der rechten Kante bis zum Ausstieg durchsteigen.', 'Fun Stuff', 5],
[48.218842,16.370814, 'Sebi schummelt, 6C/6C+, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/sebi-schummelt', 'Sebi schummelt', '6C/6C+', 'Diese Route beginnt mit einer Mischung aus kleingriffigen und weiten Zügen und endet mit einem gemeinen Dynamo von der Fuge im letzten Foto und geht hinauf zur Kante. Leider gibts von diese Route zur Zeit keine besseren Fotos. Ich hoff die Route wird klarer, wenn das Flexwand Quatett komplett ist.', 'Den Dynamo wirklich nur von der einen Fuge machen.', 'Stonewalls', 5],
[48.21886,16.370794, 'Hohe Augartenkante, 6B, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/hohe-augartenkante', 'Hohe Augartenkante', '6B', 'Wem die normale Augartenkante bei der Flexwand zu leicht oder zu abgeschmiert ist kann sich das Ganze, wie hier von Florian demonstriert, eine Etage höher anschauen. Eine sehr kleingriffige und technisch anspruchsvolle Route- vor allem in dieser Höhe.', 'Ein Crashpad wird von uns wärmstens empfohlen, weil man ständig über den Gehsteigkanten bouldert.', 'Stonewalls', 5],
[48.218839,16.370825, 'Traverse zum Bullauge, 6C, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/traverse-zum-bullauge', 'Traverse zum Bullauge', '6C', 'Diese Route ist gar nicht so leicht wie sie aussieht, denn man hat auf der Höhe vom Bullauge nur wenige gute Griffe und noch weniger Tritte.', 'Durchhalten...bis zum Bullauge!', 'Stonewalls', 5],
[48.242442,16.386621, 'TiMe Do Loko, 6C/6C+, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/time-do-loko', 'TiMe Do Loko', '6C/6C+', 'die lange wand vom handelskai ist gefallen. ...  \n leistenkletterei vom feinsten plus auflegertop machen die sechs meter hohe wand bis zur letzten sekunde interessant. Ihr findet die route rechts von der schiffsanlegestelle einfach auf die tags achten. viel spass und seits vorsichtig. is ne sehr tückische route ', 'sitzstart. ...  \n keine fugen greifen die griffe sind gut!!!!', 'Stonewalls', 2],
[39.929262,3.110408, 'Plattenspieler, 2+, Sculptures', 'http://www.urban-boulder.com/de/boulderroute/plattenspieler', 'Plattenspieler', '2+', 'Lustige schuppenkletterei und nen kleinen vorgeschmack auf die aussicht dort oben bekommt ihr auch mit auf den weg.', 'hinkommen und nicht erwischen lassen...', 'Sculptures', 5],
[48.218845,16.370809, 'Blutiges Knie, 6C, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/blutiges-knie', 'Blutiges Knie', '6C', 'Insgesamt 4 Griffe. Start mit den beiden Seitgriffen auf dem großen Block. Links hinauf auf eine kleine Leiste, dannach mit Rechts zu einer noch Kleineren. :-) Dann möglichst ruhig zur Kante hinauf ziehn.', 'keine...', 'Stonewalls', 5],
[48.218855,16.370808, 'Stone Circus, 6C/6C+, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/stone-circus', 'Stone Circus', '6C/6C+', 'Wie im Zirkus gehts bei dieser Route drunter und drüber. Den Beginn bildet ein variantenreicher Block in Hüfthöhe bei dem man mit beiden Händen beginnt. Dannach kommen zwei gemeine Seitgriffe. Vom zweiten Seitgriff muss man dann zur letzten Leiste weit übergreifen. Bei dieser Route ist Körpergröße nich unbedingt ein Vorteil.', 'Die ersten beiden Griffe darf man mit beiden Händen nehmen.', 'Stonewalls', 5],
[48.218845,16.370801, 'Odrada, 6C/6C+, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/odrada', 'Odrada', '6C/6C+', 'Die härteste Stelle ist bei dieser Route sicherlich der Einstieg. Man beginntmit einem sehr weiten Zug von zwei Mini-Griffen aus und ohne gscheite Tritte. Damit man zumindest irgend einen Grip auf den linken Fuß bringt, sollte man diesen eindrehen- daher stammt auch der Name. Der rest ist eine nette, weit gesteckte Route mit einer interessanten Stelle zum übergreifen.', 'Immer brav den Fuß eindrehen.', 'Stonewalls', 5],
[48.21886,16.370797, 'The Knife, 6C, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/knife', 'The Knife', '6C', 'Dieser Boulder ist eine sehr nette und auch technisch herausfordernde Route. Man muss im Mittelbereich tendenziell sehr hoch ansteigen um die Griffe, v.a. den Seitgriff, gut nehmen zu können. Angeblich war diese Route bereits einmal mit grünen Farbpunkten markiert. Wegen den Graffitis sind sie jetzt leider nicht mehr zu sehen.', '1. Griff- Aufleger, 2. Griff- schöne Leiste, 3. Griff Seitgriff mit Links, 4.Griff- Henkel. Die Route kann man verschärfen, indem mann den ersten und letzten Griff weglässt.', 'Stonewalls', 5],
[48.218854,16.370822, 'Drei Gewinnt, 6C, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/drei-gewinnt', 'Drei Gewinnt', '6C', 'Wieder eine Route von Norbert- ein Spezialist für lange Züge. Hier eine schöne Route die mit nur drei Griffen bis zum Top-out links vom Podest führt.', 'Crashpad empfohlen.', 'Stonewalls', 5],
[48.218855,16.370801, 'Long John, 6C, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/long-john', 'Long John', '6C', 'Große Griffe- weite, technische, einarmige Züge. Macht viel Spaß!', 'Höhe beachten! Crashpad empfohlen', 'Stonewalls', 5],
[48.218849,16.370824, 'Auxin, 6C, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/auxin', 'Auxin', '6C', 'Diese Route hat uns Norbert gezeigt. Der Boulder hat drei Griffe (recht große Aufleger) die man jeweils mit beiden Händen nehmen darf. Die Schwierigkeit besteht darin, dass die Züge von einem Griff zum Nächsten recht weit sind und man dahre sehr hoch ansteigen muss. Auch die Höhe ist nicht zu unterschätzen!', 'Alle Griffe mit beiden Händen erlaubt. Crashpad empfohlen', 'Stonewalls', 5],
[48.218866,16.370768, 'Sitting Bull, 6C, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/sitting-bull', 'Sitting Bull', '6C', 'Die Route (hier von Florian gezeigt) besteht eigentlich nur aus einer einzigen Bewegung- einem Dynamo hinauf zum Bullauge. Die Startgriffe sind zwei mittelprächtige Leisten. Zum Schwung holen steigt man mit dem linken Fuß auf das Plattoo und schiebt sich ein bisschen zum Bullauge hinauf. Dann schnappt man mit der rechten Hand zur Kante. Dieser Dynamo ist perfekt für koordinations-Talente mit ordentlich Schmalz im Oberarm.', 'Eigentlich keine. Nur auf die Hundehaufen aufpassen  ...', 'Stonewalls', 3],
[48.207485,16.437339, 'Blöx I, 6C, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/bl%C3%B6x-i', 'Blöx I', '6C', 'Auf einem pfeiler von der Praterbrücke gibt es viele klettermöglichkeiten. Diese route ist auf die kante, ist ungefär 5 meter hoch und had kleine griffe mit eine weitem zug bis zum top.', 'keine fugen! von oben kann man mit ein bandschlinge das seil einhängen.', 'Stonewalls', 5],
[48.218848,16.370793, 'Kreuz und Quer, 6C, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/kreuz-und-quer', 'Kreuz und Quer', '6C', 'Viel überkreuzen und weite Quer-Züge sind bei dieser Route an der Flexwand zu bewältigen. Zwei gemütliche Startgriffe- dann weit überkreuzen zum Seitgriff. Der nächste Zug geht quer nach recht obenm wo man mit links auch gleich den kleinen Aufleger mit nimmt. Von dem kleinen Block geht dann ein sehr weiter Zug nach rechts oben zu einer relativ schönen Kante. Von dort aus sollte man mit der linken Hand nach oben zur schrägen Kante ziehen= hohe Schlüsselstelle.', 'Alles steigen. Crashpad empfohlen!', 'Stonewalls', 5],
[48.218851,16.370793, 'Lateral, 6C, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/lateral', 'Lateral', '6C', 'Bei zwei lockeren Startgriffen beginnt die Route "Lateral" bei der Flexwand. Der erste Zug geht dann gleich sehr weit nach links oben, wo in der oberen Mitte vom großen Block eine gute Leiste ist. Dann heißt es hochsteigen, und über den rechten Fuße nach oben schieben, damit man den nächsten Griff (Seite vom quadratischen Block) zu halten bekommt. Dann mit der zweiten Hand zur linken Seite des selben Blocks, hochsteigen und raufgreifen. Der letzte Zug ist nochmal eine Herausforderung.', 'Vom letzten Block nur die Seiten verwenden. Alles steigen. Crashpad empfohlen.', 'Stonewalls', 5],
[48.218843,16.370823, 'Side by side, 6B, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/side-side', 'Side by side', '6B', 'Die Route "Side by side" bei der Flexwand ist ein lecker-technisches Schmankerl. Der Einstieg ist ein wenig gewöhnungsbedürftig, mit beiden Händen an einem Seitgriff. Dann gehts gleich weiter mit einer Folge von weiteren Seitgriffen nach rechts oben, bis man beim letzten Griff angelangt ist. Diese Mini-Leiste muss man mit der linken Hand halten, das Gewicht nach rechts bringen und mit Schwung nach oben zur Kante schnappen.', 'Nur die einzelnen Seitgriffe erlaubt. Keine Fugen! Alles steigen. Crashpad empfohlen.', 'Stonewalls', 5],
[48.205332,16.434264, 'Titanic, 4, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/titanic', 'Titanic', '4', 'Die Titanic ist also doch in Wien auf Grund gelaufen. Zumindest sieht der Brückenpfeiler der Tangenten-Brücke dem Bug des Schiffes ein bisschen ähnlich. Er bieten auch ein paar gute Traversen und kurze Routen nach denen man sich fast wie der "König der Welt" fühlt! Zugang über die U2-Station Donau-Marina. Gleich nebenan gibt es ein paar Stahlkonstruktionen (Wendel, Stiegenaufgang) wo man sich auch ein bisschen austoben kann. Leider ist der Lärm von der Bahnlinie und der Tangente ziemlich stark.', 'Keine Fugen!', 'Stonewalls', 5],
[48.204373,16.432666, 'Tangentenriss, 6C, Cracks', 'http://www.urban-boulder.com/de/boulderroute/tangentenriss', 'Tangentenriss', '6C', 'Auf der Seite vom 2. Bezirk wo der Fußgänger und Fahrradweg über die Donau beginnt gibt es diesen netten Riss in der Betonwand. Leider ist der Beton etwas bröckelig. Man rutscht mit den Fingern leicht heraus. Zum treten gibt es nur ein paar winzige Schalungslöcher die nicht wirklich viel hergeben. Ziel ist der Stahlträger der Schallschutzwand. Alles in allem eine interessante Route.', 'Watch your back...Die Radfahrer kommen mit einem ziemlichen "Karacho" daher!', 'Cracks', 5],
[48.20513,16.434587, 'aus Stahl gefertigten campusboard, 5A, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/aus-stahl-gefertigten-campusboard', 'aus Stahl gefertigten campusboard', '5A', 'die treppe hochklettern so wie am campusboard. die ausstieg ist beim pfeiler', 'bis zum pfeiler gibts die möglichkeit ein crashpad hinzulegen, danacch wird es schwierig also, nicht fallen!', 'Pure Steel', 1],
[48.214215,16.398913, 'Prater Dachl, 2+, Fun Stuff', 'http://www.urban-boulder.com/de/boulderroute/prater-dachl', 'Prater Dachl', '2+', 'bei einem spielplatz in Praterpark gibt es ein dach. es ist einfach rauf zu klettern mit ein "heel- hook"', 'man braucht kein crashpad und kein kletterschuhe', 'Fun Stuff', 5],
[48.218846,16.370792, 'Rechte Gerade, 6B, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/rechte-gerade', 'Rechte Gerade', '6B', 'Die rechte Gerade ist etwa so hart wie ein Faustschlag bei einem Boxkampf...wow, wahnsinns Rhetorik...:-) Technisch anspruchsvoll und sehr hoch.', 'Crashpad unbedingt notwendig. Ein paar mal auf und ab klettern um die Griffe kennen zu lernen. Nicht runterschaun!', 'Stonewalls', 5],
[48.218792,16.370943, 'Kaiwandpfeiler-Senior, 6B, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/kaiwandpfeiler-senior', 'Kaiwandpfeiler-Senior', '6B', 'Der große Bruder von "Kaiwand-Pfeiler Junior" gleich rechts neben der Flexwand nach dem Stufenabgang. Eine sehr technische und nervenaufreibende Übung- vor allem im oberen Teil...na eh klar!', 'Es gelten nur die Griffe am rechten Rand des Pfeilers. Die Flächen rechts und links der beiden Verschneidungen dürfen nicht verwendet werden. Achtung wegen dem kleinen Baum- der steht genau in Fallrichtung!', 'Stonewalls', 5],
[48.218847,16.370809, 'up the nook, 6C, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/nook', 'up the nook', '6C', 'rein in die Ecke &amp; dann einfach bis ganz oben raufarbeiten ;-)', 'DON \' T FALL ;-)', 'Stonewalls', 5],
[47.396912,12.885364, 'Speckhütte-Starthäusl, 4, Fun Stuff', 'http://www.urban-boulder.com/de/boulderroute/speckh%C3%BCtte-starth%C3%A4usl', 'Speckhütte-Starthäusl', '4', 'Bei einer Wanderung am Fuß des Hundstein mussten die kampfprobten Alpinisten auf dem Weg zu ihrer Jause einige halsbrecherische Hürden überwinden. Eine der härteren Etappen dieses Sonntagsspaziergangs war die Besteigung des Schattberg-Starthäusls. Anregungen zur technischen Besteigung entnimmt man am besten den Fotos. Wichtig: Das Starthäusl vom Schattberg ist vom klettertechnischen Standpunkt aus nicht mit dem indianischen Tipi, das eine gänzlich andere Herangehensweise erfordert, zu verwechseln. Viel Spaß...', 'Bei Schneelage ist der Abstieg etwas angenehmer.', 'Fun Stuff', 5],
[48.149267,16.404739, 'Steinkonus, 2, Fun Stuff', 'http://www.urban-boulder.com/de/boulderroute/steinkonus', 'Steinkonus', '2', 'Ein gut versteckter ziemlich großer gemauerten Steinkonus in der nähe des nordöstlichen WIG einganges. ...  \n Es sieht recht einfach aus da hochzukommen. ...  \n Bildquelle: ...  \n <a href="http://www.wildurb.at/acts/article/lebhaftes-treiben-30/">http://www.wildurb.at/acts/article/lebhaftes-treiben-30/</a>', 'Freie wahl.', 'Fun Stuff', 1],
[48.219844,16.369559, 'Roßauer Kante, 5A, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/ro%C3%9Fauer-kante', 'Roßauer Kante', '5A', 'Von der Flexwand einfach zur nächsten Brücke stromaufwärts liegt dieses neu Projekt. Die Brücke heißt Roßauer Brücke und ist gleich gegenüber der gleichnamigen Kaserne. Die Route beginnt mit einem Riss der nach rechts gut zu greifen ist. Eine Spaziergängerin zeigt die Technik auf Foto2 ganz gut. :-) Zum steigen hat man mehr als genug Rillen zwischen den Quadern. Oben gibts dann eine Querung entlang der obersten Fuge bis zu dem schwarzen Dehnungsband. Von dort gehts mit einem weiten Zug und Untergriff am Randbetonstein nach oben.', 'Nur mit Seilsicherung am Geländer! Bandschlinge und Schraubkarabiner optimal.', 'Stonewalls', 3],
[48.243537,16.433369, 'Kagraner Riss, 5A, Cracks', 'http://www.urban-boulder.com/de/boulderroute/kagraner-riss', 'Kagraner Riss', '5A', 'At the U1 underground station, on the western side, the sidewalk is covered by a roof that is held up by red iron poles. There are always two poles adjacent to each other, a big one and a small one. between those poles you can place and lock your hand so you can climb up. ...  \n Once you are at the roof, you can grab the side with both arms and move towards another pair of poles. there which you can them climb down. ...  \n When one is experienced in crack climbing, it should not pose a challenge.', 'There are not too many security cameras at the station, and staying out of their sight to not attract attention from security personell is not that bad of an idea. ...  \n Altough the crack is not difficult to climb an inexperienced crack climber might have to consider bringing a crashpad', 'Cracks', 5],
[48.167234,16.316264, 'Hetzendorfer Bahnriss, 6C, Cracks', 'http://www.urban-boulder.com/de/boulderroute/hetzendorfer-bahnriss', 'Hetzendorfer Bahnriss', '6C', 'Dieser Riss ist direkt unter der Bahnbrücke über die Altmannsdorferstraße (S-Bahnstation Hetzendorf) zu finden. Man kommt bequem mit den Fingern hinein und kann auf dem groben Beton gut steigen. Nach dem etwa 6m langen Riss gibts noch als Draufgabe einen weiten Zug hin zum Ausstieg aufs Geländer. Viel Spaß beim Rissklettern!', 'Nur mit Bouldermatte! Man kann sich aber auch vom Geländer mit Seil sichern.', 'Cracks', 3],
[48.234506,16.383854, 'Efeuriss , 7B, Cracks', 'http://www.urban-boulder.com/de/boulderroute/efeuriss', 'Efeuriss ', '7B', 'Dieser Riss wurde meines Wissens bis dato noch nicht bestiegen. Bis vor kurzem war die Wand noch von Efeu-Rankgewächsen zugewuchert. Mit der Renovierung der S-Bahn Station Traisengase im Jahr 2009/2010 wurden die lästigen Pflanzen jedoch entfernt und siehe da- ein etwa 6m hoher Fingerriss kommt zum Vorschein. Ich hab ihm mal 9 von 10 Punkten auf unserer Schwierigkeitsskala gegeben, weil ich nicht glaube, dass da so leicht wer raufkommen wird. Aber ich lasse mich gerne eines Besseren belehren...;-)', 'Der Weg an dem die Route liegt ist ein halbprivater Fußweg zu einem Wohnbau. Also dort eher nicht in der Nacht klettern oder zu laut anfeuern. Ansonsten gibt es bei dieser Route keine Einschränkungen. Sobald man über die erste Querrille kommt sollte man ein Crashpad verwenden. Eine Sicherung mit Seil wäre von oben auch möglich.', 'Cracks', 5],
[48.212336,16.38379, 'boulder salad, 5A, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/boulder-salad', 'boulder salad', '5A', 'Zutaten: ne Laterne, 3 unterschiedliche Wandtypen &amp; ne urban boulder zertifizierte Säule', 'Rule 1: DONT FALL!!! ...  \n Rule 2: if u need to break rule 1, have a crashpad with u and use it appropriate ;-)', 'Stonewalls', 5],
[49.896783,10.89188, 'Bamberger-Spezial, 2+, Buildings', 'http://www.urban-boulder.com/de/boulderroute/bamberger-spezial', 'Bamberger-Spezial', '2+', 'Die Region Oberfranken ist bekannt für ihr köstliches Rauchbier und ihr g \' standenes Essen. Diese Gaumenfreunden lassen sich am besten in der verträumt-romatischen-mittelalterlichen Kleinstadt Bamberg in der uralten Brauerei  \' Spezial \'  ausprobieren. Dannach empfiehlt es sich zur Verdauung in der nahe gelegenen städtischen Bücherei ein bisschen Bewegung zu machen. Die moderne Bücherei fügt sich zur Freude der Kletterer auf zurückhaltende Weise in das mittelalterliche Ensemble ein und bietet vielfältige Klettermöglichkeiten.', 'Nur in den Nachtstunden zu empfehlen, da man sonst die hinter den Fenstern lesenden Büchereibesucher in ihrer Konzentration stören könnte.', 'Buildings', 5],
[48.212321,16.383547, 'Sunrise boulder, 4, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/sunrise-boulder', 'Sunrise boulder', '4', 'Gegenüber von der Urania bzw. schräg gegenüber von der Herman Strandbar gelegen eignet sich diese Wand optimal für einen sonnigen "Guten Morgen Boulder" im Herzen von Wien :-)', 'Nach dem ersten Aufwärmen ohne Verwendung der Seitenwand hoch bis zum Geländer sorgt für einen optimalen Start in den Tag.', 'Stonewalls', 2],
[49.453252,11.078868, 'Nürnberg hat Wände!, 6C, Sculptures', 'http://www.urban-boulder.com/de/boulderroute/n%C3%BCrnberg-hat-w%C3%A4nde', 'Nürnberg hat Wände!', '6C', 'Bei einem Kurzaufenthalt in Nürnberg ist uns auf den ersten Blick das große Potenzial dieser Stadt aufgefallen. Ihr mittelalterlicher Burggraben mit den gut geeigneten Steinwänden gepaart mit neueren Skulpturen und Architektur machen die Stadt zu einem ausgezeichneten Reiseziel für Urban-Boulderer. Eher nicht zum Klettern (aus klettertechnischer als auch historischer Sicht) eignet sich das Albrecht-Dürer-Haus und das ehemalige Reichsparteitagsgelände.', 'Zuerst klettern dann Rauchbier...nicht umgekehrt! ;-)', 'Sculptures', 5],
[48.218792,16.370833, 'I walk the line, 6B, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/i-walk-line', 'I walk the line', '6B', 'Kein Kindergeburtstag: Ausnahmslos nur vertikale Fugen.', 'Kein Kindergeburtstag: Ausnahmslos nur vertikale Fugen.', 'Stonewalls', 5],
[48.218792,16.370833, 'Doppeldyni Flexwand, 6C/6C+, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/doppeldyni-flexwand', 'Doppeldyni Flexwand', '6C/6C+', 'Heut wurde uns wieder eine neue Route bei der Flex-Wand gezeigt und die hats in sich. Sitzstart mit einem normalen Tritt und ein Hook. Aufstehen und ein weiter Zug mit der rechten Hand nach oben. Der Dynamo bis zum Top geht von den zwei Seitgriffen rechts und links auf dem großen Block aus. Am &gt;einfachsten&lt; mit der rechten Hand raufschnappen. Wenn man möchte kann man auch gleich mit beiden Händen gleichzeitig rauf...siehe Video...', '2 Startgriffe, 1 Griff mir Rechts, 2 Seitgriffe auf dem großen Block, Dynamo zur Kante rauf...', 'Stonewalls', 5],
[48.230437,16.328849, 'Gersthofer Wadlspreizer, 6C, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/gersthofer-wadlspreizer', 'Gersthofer Wadlspreizer', '6C', 'Die Route ist gleich in der Nähe der S-Bahnstation Gersthof. Es ist eine pipifeine Verschneidung zwischen dem Brückenpfeiler und einer Stützmauer. Immer schön steigen, dann kann man sich leicht mit den Armen höherschieben. Witzige Route!', 'Der Abstieg ist etwas umständlich, aber man kann dafür das Gewista-Plakat ein bisschen zur Hilfe nehmen. Crashpad mitnehmen!', 'Stonewalls', 4],
[48.2301,16.329077, 'Gewistapfeiler, 6C, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/gewistapfeiler', 'Gewistapfeiler', '6C', 'Neue Route bei S-Bahn Station Gersthof. Der Granit-Pfeiler hat die perfekte Höhe um noch mit Crashpad sauber abspringen zu können. Zum Absteigen kann man aber auch die rechte Verschneidung mit der schrägen Mauer benutzen. Der Verkehr dort ist etwas stärker, aber am Abend nach 18h ist es ganz okay. Wir sind eben in der Stadt und nicht im Wald. ;-)', 'Die einfache Variante ist mit allen drei Pfeilerwänden. So kann man sich schön eindrehen und die rutschigen Aufleger besser nehmen. Schwieriger wird die Sache wenn man die linke Seitenwand bei der Gewista Plakatwand weglässt. Dann steigert sich die Route um einiges. Crashpad mitnehmen. Die Route ist etwa 5 Meter hoch.', 'Stonewalls', 4],
[48.21873,16.37098, 'Kaiwand-Dynamo, 6B, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/kaiwand-dynamo', 'Kaiwand-Dynamo', '6B', 'Ein weiteres Highlight an der Flexwand. Rechts vom »Kaiwand-Pfeiler Junior« gelegen, gibt es diesen feinen Dynamo. Relativ leichter Einstieg, dann ein puristischer – im Optimalfall beherzter – Dynamo zur erlösenden Kante. Erschwerend: Griffe (links: 2-Finger-Leiste/Loch) und vorallem Tritte sind suboptimal.', 'Ohne linke Seitenwand (welche eh nix hilft). Hier ebenfalls: Crashpad-Pflicht!', 'Stonewalls', 3],
[48.242298,16.386843, 'Finnland is nice, 6B, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/finnland-nice', 'Finnland is nice', '6B', 'Direkt unter der U6-Brücke beim Handelskai gibts eine herrliche 6 Meter hohe Steinwand. Die Route  \' Finnland is nice \'  ist knifflig- aber nicht unschaffbar. Der letzte Griff vorm Top is super! Dann ist es nur mehr ein bisschen Überwindung- und man ist oben.', 'Dicke Bouldermatten mitnehmen- die Wand ist höher als man glaubt! Unbedingt (wenn möglich) kontrolliert Abspringen- bei dieser Gelegenheit: Gute Besserung Ulla!!! Taffe Aktion...', 'Stonewalls', 5],
[48.213857,16.375798, 'No sorry, boy-Verschneidung, 6B, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/no-sorry-boy-verschneidung', 'No sorry, boy-Verschneidung', '6B', 'Von der Salztorbrücke in Richtung Schwedenplatz in der Nähe des Kanalrisses liegt eine gut kletterbare, tolle Verschneidung. Absprunggelände derzeit noch über Sand (dennoch ist eine Bouldermatte oder das Ausbouldern vorher mit Seil anzuraten, da die knifflige Stelle natürlich oben ist). ...  \n First ascent: Roberto / Erste Wiederholung: prixx', 'Letzer Zug über Absprunghöhe, daher ist das Ausbouldern vorher mit Seil anzuraten, da die knifflige Stelle trotz guter Griffen und Tritte natürlich oben ist. Für den Mittelteil: Tritte/Griffe ohne der rechten roten Graffiti-Betonputzplatte (da diese ausbrechen kann, und das Graffiti sollte auch erhalten bleiben).', 'Stonewalls', 5],
[48.21873,16.37098, 'Kaiwand-Pfeiler Junior, 6B, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/kaiwand-pfeiler-junior', 'Kaiwand-Pfeiler Junior', '6B', 'Gleich rechts von der klassischen Flexwand, noch vor dem Kaiwand-Dynamo, befindet sich der »Kaiwand-Pfeiler Junior«. Schöne Route mit anspruchsvollen Tritten und Miniriss im oberen Teil.', 'Pfeiler only, ohne Hauptwände, nur der vorspringende Teil. Wärmste Empfehlung: Crashpad!', 'Stonewalls', 4],
[48.214063,16.375675, 'Kanalriss, 6B, Cracks', 'http://www.urban-boulder.com/de/boulderroute/kanalriss', 'Kanalriss', '6B', 'Genialer Riss bei der Salztorbrücke auf der Seite vom 2.Bezirk. Die Route ist bis zum Top etwa 6m hoch und daher nicht zu unterschätzen. Der Riss weitet sich nach oben hin vom Fingerriss bis auf Faustbreite auf. Nach einem etwas kniffligen Einstieg bleibt er trotzdem bis Oben interessant, weil man sauber treten muss und besonders der letzte Zug bis zur Kante unter dem Geländer etwas weiter ist. Der Riss ist mit der entsprechenden Technik nicht besonders schwer zu klettern- aber die Höhe macht ihn zu einem sehr interessanten Projekt. Von uns aus unbedingt zu empfehlen!', 'Bitte unbedingt mit dickem Crashpad- oder Seilsicherung klettern. Beim Abspringen auf die Stufe beim Podest aufpassen! Es gab dort leider schon verletzte. Bei dieser Gelegenheit auch hier: Gute Besserung Berti!', 'Cracks', 5],
[48.229244,16.411487, 'Eun-Jin, Reichsbrückenpfeiler + Stahlträger (Deep Water Solo), 6C/6C+, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/eun-jin-reichsbr%C3%BCckenpfeiler-stahltr%C3%A4ger-deep-water-solo', 'Eun-Jin, Reichsbrückenpfeiler + Stahlträger (Deep Water Solo)', '6C/6C+', 'Am besten man startet direkt vom Boot aus, da man sonst hinschwimmen muss, was vorallem den Einstieg sehr erschwert! Also vom Wasser aus direkt nach oben, bis zu der relativ feinmaschigen Metallbarriere direkt unter der Brücke und dann weiter über den Stahlträger, bis ein Betonstück den Weg versperren will. ...  \n Einfach hinübergreifen und glücklich sein wenn man den anderen Stahlträger zu halten bekommt, ansonsten möglichst angenehm im Wasser aufkommen!', 'Aufpassen, dass keine Boote unter euch sind wenn ihr klettert!!!', 'Stonewalls', 3],
[48.198146,16.320054, 'Meiselmarkt Dach, 4, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/meiselmarkt-dach', 'Meiselmarkt Dach', '4', 'Das Meiselmarkt-Dach ist unter Tags für Besucher geöffnet und bietet einen netten Rundblick über die Gegend. Man findet dort auch einige Möglichkeiten zum Klettern. Zum Beispiel wird das Dach des Meiselmarktes von riesigen Stahl-Fachwerksträgern getragen, an denen man herrlich herumturnen kann. Die Betonung liegt auf turnen- denn es ist eher einfach hochzuklettern, aber gefährlich auf den runden Stahlrohren abzurutschen. Vor allem auch weil der Lack schon an einigen Stellen abplatzt.', 'Vorsicht beim Klettern! Schuhe mit weicher Gummisohle sind von Vorteil. Nicht ohne Sicherung hochklettern!', 'Pure Steel', 4],
[48.198321,16.320612, 'Hanglstangen, 2, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/hanglstangen', 'Hanglstangen', '2', 'Jeden Tag in der Früh einmal rauf und runter hangln- und man bleibt sicher fit! :-)', 'Handschuhe wegen dem Schmutz nicht vergessen.', 'Pure Steel', 3],
[48.197849,16.319202, 'Meiselmarkt Steg, 2+, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/meiselmarkt-steg', 'Meiselmarkt Steg', '2+', 'Nette Turnübung für zwischendurch. Die Stahlkonstruktion befindet sich seitlich hinter dem Meiselmarkt- Einkaufszentrum neben der Meiselstraße.', 'Handschuhe sind Pflicht! Nicht nur wegen dem Dreck, sondern auch wegen den scharfen Kanten der Stahlkonstruktion', 'Pure Steel', 5],
[48.197719,16.320405, 'Bullauge, 6C, Buildings', 'http://www.urban-boulder.com/de/boulderroute/bullauge', 'Bullauge', '6C', 'Mitten am Meiselmarkt wurde diese kleine aber gefinkelte einzug-Route an einem Entlüftungsgebäude der U-Bahn entdeckt. Dabei hängt es stark von der Körpergröße ab wie man die Route nimmt. Kleiner und leichtere KlettererInnen haben einen kleinen Vorteil.', 'Aufpassen- die runden Bullaugenfenster sind nicht mehr die stabilsten!', 'Buildings', 5],
[48.213446,16.335364, 'Yppenplatz, 4, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/yppenplatz', 'Yppenplatz', '4', 'Es gibt einen neuen Kinderspielplatz am Yppenplatz- in Verlängerung des Brunnenmartes. Es gibt genügend Stahl-Konstruktionen zum herumturnen und für dannaach nette Lokale zum abhängen.', 'Von einem Turm zum anderen ist eine ganz nette Herausforderung, aufgrund der Höhe jedoch nur mit Crashpad zu empfehlen.', 'Pure Steel', 5],
[48.244991,16.435764, 'U1 Wandl, 4, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/u1-wandl', 'U1 Wandl', '4', 'Ein Stück stadtauswärts der U1 Station Kagran steht diese Riesen-Granitwand. Man kann eifach die Steine entlangklettern und was für die Unterarm-Ausdauer tun, oder sich den Riss zwischen der U-Bahnbrücke und der Steinwand vornehmen.', 'Vorsicht Radfahrer!', 'Stonewalls', 5],
[48.262341,16.452295, 'Park&amp;Climb, 2+, Buildings', 'http://www.urban-boulder.com/de/boulderroute/parkclimb', 'Park&amp;Climb', '2+', 'Das Parkhaus bei der U1 Aderklaerstraße ist perfekt zum klettern und parcouren geeignet. Die großen Stahlbetonteile sind zwar einfach zu greifen, aber durch die weiten Abstände doch eine Herausforderung. Außerdem ist das Parkhaus drei Etagen hoch, was eine Besteigung zu einem zusätzlichen Nervenkitzel macht.', 'Die Parkgarage ist versperrt und wird hauptsächlich von den Bewohnern der Rennbahnwegsiedlung benutzt. Also besser nicht den Verdacht auf sich lenken in die Garage einsteigen zu wollen.', 'Buildings', 5],
[48.249714,16.443065, 'Sportwettenstiegerl, 2+, Sculptures', 'http://www.urban-boulder.com/de/boulderroute/sportwettenstiegerl', 'Sportwettenstiegerl', '2+', 'In der Nähe der U1 Kagranerplatz haben wir bei der letzten Bouldersession dieses Schmankerl entdeckt und natürlich sofort ausprobiert. Bei dieser Stiege hat sich der Architekt richtig ausgelebt und uns eine perfekte Boulder-Skulptur hingestellt. Die Betonkanten sind sehr griffig, und man kann ganz locker bis zum oberen Podest klettern.', 'Da sich die Route direkt vor einem Wettlokal befindet, muss man damit rechnen, dass Wetten darauf abgeschlossen werden wer von den Kletterern als Erster abstürzt. Auch motivierende Zwischenrufe sind nicht auszuschließen. Sonst sind die sportbegeisterten Wettbürobesucher aber kein Problem. ...  \n Beim Abstieg sollte man, trotz aller Wettkampflaune, aufpassen- es sind überall Stufen und Kanten.', 'Sculptures', 5],
[48.188817,16.417466, 'Erdbergersteg, 2+, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/erdbergersteg', 'Erdbergersteg', '2+', 'Zehn Minuten von der U3-Station Erdberg kann man sich herrlich an haufenweise Stahlträgern, Brückenkonstruktionen und  Stahlseilen austoben. Am besten nimmt man diese Stahlrouten nachdem man in Erdberg seine Schulden nach dem Schwarzfahren  beglichen hat und man die angestaute Energie irgendwo abreagieren muss. ;-) ... ', 'Eher nicht nach einem feucht-fröhlichen Arenabesuch zu empfehlen.', 'Pure Steel', 4],
[48.198558,16.31897, 'Meiselmarkt Boulder, 2+, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/meiselmarkt-boulder', 'Meiselmarkt Boulder', '2+', 'Nette Stahlkonstruktion in der Nähe der U-Bahnstation Johnstraße.', 'Crashpad und Handschuhe empfehlenswert.', 'Pure Steel', 5],
[48.21882,16.370644, 'Augartenbrückenpfeiler, 4, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/augartenbr%C3%BCckenpfeiler', 'Augartenbrückenpfeiler', '4', 'Seil nur mit Bandschlinge und Karabiner befestigen. Aufpassen, beim Ausleger sind Taubenstacheln- die sind aber sehr weich und daher weniger problematisch. Handschuhe sind wegen dem Staub und Schmutz unbedingt empfohlen!', 'Seil nur mit Bandschlinge und Karabiner befestigen. Aufpassen, beim Ausleger sind Taubenstacheln- die sind aber sehr weich und daher weniger problematisch. Handschuhe sind wegen dem Staub und Schmutz unbedingt empfohlen!', 'Pure Steel', 5],
[48.175423,16.394158, 'Geiselberg, 6C, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/geiselberg', 'Geiselberg', '6C', 'Schöne Natursteinmauern an der Gudrunstraße kurz vorm Grässlplatz. Ist ziemlich lang und gibts von leicht bis schwer alles.', 'keine', 'Stonewalls', 1],
[48.186875,16.337595, 'Blitzableiter-Boulder, 2+, Fun Stuff', 'http://www.urban-boulder.com/de/boulderroute/blitzableiter-boulder', 'Blitzableiter-Boulder', '2+', 'Gleich neben dem  \' Wienzeilendachl \'  neben der U6 Trasse zwischen Gumendorfer- und Längenfaldgasse gibt es einige Möglichkeiten zu klettern. Darunter auch dieser Stahlmast der auch als Blitzableiter funktioniert.', 'Nicht bei Gewitter benutzen! -)', 'Fun Stuff', 5],
[48.190938,16.337461, 'Gumpendorfer-Traverse, 5A, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/gumpendorfer-traverse', 'Gumpendorfer-Traverse', '5A', 'Eine neue Route bei der U6-Station Gumpendorferstraße wurde entdeckt! Die Route führt über einen Durchgang unter der Zugtrasse. Der Stein ist sehr griffig aber auch scharf. Handschuhe empfohlen. Crashpad wär auch gut.', 'no rules...', 'Stonewalls', 3],
[48.235319,16.335023, 'Türkenschanze, 2, Other Stuff', 'http://www.urban-boulder.com/de/boulderroute/t%C3%BCrkenschanze', 'Türkenschanze', '2', 'Unter einer kleinen Fußgängerbrücke in der Nähe des Turmes im Türkenschanzpark gibt es diese Steinblöcke. Sie sind eher leicht zu klettern, doch man kann sich schon auch einige feine Routen überlegen.', 'Schuhe nicht unbedingt notwendig.', 'Other Stuff', 5],
[32.071944,34.772303, 'Strommast, 10, Fun Stuff', 'http://www.urban-boulder.com/de/boulderroute/strommast', 'Strommast', '10', 'Strolling around in Tel Aviv we saw these &gt;climbing forbidden&lt; signs- and of course had to leave our sticker there. Luckily it was not only written in hebrew. ...  \n We hope that our frinds in Tel Aviv like the sticker and take the warnings serious. ;-) ...  \n Tel Aviv- we love you!', 'Danger of Death!', 'Fun Stuff', 3],
[32.07078,34.77308, 'Tel Aviv-Boulder, 2+, Fun Stuff', 'http://www.urban-boulder.com/de/boulderroute/tel-aviv-boulder', 'Tel Aviv-Boulder', '2+', 'Climbing in Tel Aviv is very funny, especially when its nice and warm in the middle of february. For me its the most beautiful city in the middle east! I loved stralling around the beach, Rothschild  Boulevard and Jaffa. But the best of it all was climbing its facades...:-)', 'Enjoy your stay and don \' t let you be cought be yelling neighbors.', 'Fun Stuff', 4],
[30.322603,35.451398, 'Petra-Jordanien, 4, Sculptures', 'http://www.urban-boulder.com/de/boulderroute/petra-jordanien', 'Petra-Jordanien', '4', 'Petra is one of the most fascinating ancient complexes in the world. The temples and tombs were carved deep into the soft sandstone and are nowadays admired by thousands of tourists every year. But not only the manmade structures are worth to mention, but the amazing stone formations formed by wind and water to organic, colorful stone sculptures which are really nice to climb.', 'Dont climb on ancient temples and try not to disturb the local beduins.', 'Sculptures', 4],
[31.458897,35.398786, 'Totes-Meer-Boulder, 2+, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/totes-meer-boulder', 'Totes-Meer-Boulder', '2+', 'Auf der israelischen Seite des Toten Meers gibt es einen kleinen Badeort namens Ein Gedi. Dort lässt sich bequem das Baden im am tiefsten gelegenen und salzigsten Meer der Erde mit einer kleinen Kletterpartie verbinden. Die Sonnenschirme sind wie dafür gemacht. Leider kann man sich dort nicht direkt ins Wasser fallen lassen- das geleeartige Wasser wäre auch nicht optimal dafür, und außerdem schmeckt es abscheulich.', 'Eher nicht von den Badewaschln erwischen lassen, und auf keinen Fall das Meerwasser schlucken! ;-)', 'Pure Steel', 5],
[31.779867,35.227704, 'Jerusalem-Stadtmauer, 2+, Fun Stuff', 'http://www.urban-boulder.com/de/boulderroute/jerusalem-stadtmauer', 'Jerusalem-Stadtmauer', '2+', 'Für alle die einmal nach Jerusalem kommen empfielt es sich vorher zu informieren, auf welcher Mauer oder welchem Gebäude man herumturnt, da man sonst sehr leicht Probleme mit der einen oder anderen Glaubensgemeinschaft bekommen könnte.', 'Lets do the secular stuff where space is not needed for religious or cultural stuff.', 'Fun Stuff', 4],
[47.13533,13.10095, 'Angertal-Mast, 2+, Fun Stuff', 'http://www.urban-boulder.com/de/boulderroute/angertal-mast', 'Angertal-Mast', '2+', 'Eine kleine Kletterübung zur Abwechslung zum Snowboarden oder Schifahren.', 'Nicht in den Strom greifen. Der Tiefschnee federt beim Abstieg aber schön nach.', 'Fun Stuff', 5],
[41.026372,28.931334, 'Topkapi-Istanbul, 2+, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/topkapi-istanbul', 'Topkapi-Istanbul', '2+', 'Klettern ist in Istanbul eindeutig zu den Randsportarten zu zählen und deshalb von vielen Passanten als ungewöhnlich erachtet. Gerade wenn man an Kulturstätten wie der 1500 Jahre alten Stadtmauer herumklettert sollte man sich immer den kulturellen Differenzen und möglichen Reaktionen der Passanten und Polizisten bewusst sein.', 'Achtung vor losen Steinen entlang der gesamten Stadtmauer!', 'Stonewalls', 5],
[41.029751,28.934821, 'Schiefe Wand von Istanbul, 2+, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/schiefe-wand-von-istanbul', 'Schiefe Wand von Istanbul', '2+', 'Die Land-Stadtmauer Istanbuls  \' Topkapi \'  ist 6,7 km lang und stammt aus dem 5.Jhdt n.Chr. Leider wurde sie bis heute nicht generalsaniert, weshalb sie durch Verwitterung, Setzungen und Erdbeben stark in Mitleidenschaft gezogen wurde. Die Wände und Türme weisen oft Risse auf und es sind nicht selten lose, absturzgefährdete Stücke zu sehen. Deshalb unbedingt aufpassen wo man klettert!', 'Achtung vor losen Steinen! Nur an Stellen klettern, wo sich die Steinwände in gutem Zustand befinden! Helm und feste Schuhe wären gut. ...  \n Achtung vor den Polizeikontrollen. Sie suchen zwar nicht nach Kletterern sondern nach Obdachlosen, aber trotzdem können sie sehr unfreundlich darüber reagieren.', 'Stonewalls', 4],
[41.010704,28.922311, 'Stadtmauer-Istanbul, 4, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/stadtmauer-istanbul', 'Stadtmauer-Istanbul', '4', '2010 ist Istanbul Kulturhauptstadt Europas. Die Gelder dafür wurden bis jetzt größtenteils anstatt in zeitgenössische, westlich-offene Kunst und Kultur eher in die Erhaltung und Förderung traditioneller Kulturangebote investiert. Hauptsächlich wurden Moscheen, Kulturstätte und Museen renoviert. So ist es umso erstaunlicher, dass die 6,7km lange Stadtmauer  \' Topkapi \'  aus dem 5.Jhdt n.Chr. weiterhin tatenlos dem Verfall preisgegeben wird.', 'Die Stadtmauer befindet sich in äußerst schlechtem Zustand. Es gibt viele Risse und lose Steine, vor allem im oberen Bereich der Mauern. Also unbedingt aufpassen wo man klettert, und vielleicht sogar einen Halm einpacken. Kletterschuhe sind meist nicht notwendig. ...  \n Es sind auch teilweise Polizeistreifen unterwegs, die wahrscheinlich Obdachlose von dort fernhalten sollen. Also vielleicht eher in den abgelegeneren Teilen der Mauer klettern- sie ist ja gottseidank wirklich sehr lange.', 'Stonewalls', 5],
[48.165897,16.325442, 'Kabelwerk-Unterzug, 2+, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/kabelwerk-unterzug', 'Kabelwerk-Unterzug', '2+', 'Direkt im Kabelwerk, in der Nähe des zentralen Hauptplatzes gibt es seitlich rechts von einem langgestreckten Wohnhaus eine paar, wie zum klettern gemachte Stahlkonstruktionen.', 'Bei dieser Route gibt es keine besonderen Regeln.', 'Pure Steel', 5],
[48.167778,16.325222, 'Fussballboulder, 4, Buildings', 'http://www.urban-boulder.com/de/boulderroute/fussballboulder', 'Fussballboulder', '4', 'Direkt neben dem Fussballplatz beim Kabelwerk befindet sich eine kleine Betonhütte neben den Gleisen der Schnellbahn. Die Route ist sehr nett und relativ ungefährlich, aber man muss sich schon ein bisschen strecken um bis zur oberen Betonkante zu kommen.', 'Der Türgriff und die Vertiefung in der Betonwand dürfen zum steigen verwendet werden. Beim Greifen am Metallgitter bitte aufpassen- ist nicht das Stabilste!', 'Buildings', 4],
[48.238992,16.395975, 'Brigittenauer Spirale, 5A, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/brigittenauer-spirale', 'Brigittenauer Spirale', '5A', 'Der Fußgängerübergang der Brigittenauer Brücke führt in 2 Spiralen (am Handelskai, und auf der Donauinsel) auf das Brückenniveau hinauf. Die Konstruktion ist ident, aber auf der Donauinsel ist Wiese darunter, am Handelskai sind Pflastersteine.  Die Träger haben in der Regel ca. 1-2 cm breite Kanten zum Anhalten.', 'Beim Betonsockel starten, den Querträger entlang nach außen, dann raufgreifen (auf die Kante der Rundung, oder direkt in die Rohrdurchführungen), und dann außen das Geländer hinauf.', 'Pure Steel', 3],
[41.019736,29.007597, 'Bosphorus Shipwreck, 2, Fun Stuff', 'http://www.urban-boulder.com/de/boulderroute/bosphorus-shipwreck', 'Bosphorus Shipwreck', '2', 'Between Europe and Asia - at the Bosphorus - a boat collapsed. It got washed ashore in Istanbul, Anatolian side, at the seashore of Üsküdar district! Poor shipwreck, free of any purpose, we will give your brokedown body a new meaning... Boulder up the crooked main mast and enjoy being between two continents!', 'Up, up, until the top of the main mast! Be aware of wild cats and rust stains. Against both threats I recommend an obviating Tetanus injection. And don \' t fall into the water!', 'Fun Stuff', 5],
[48.212281,16.38352, 'Urania-Säule, 6C, Power Boulder', 'http://www.urban-boulder.com/de/boulderroute/urania-s%C3%A4ule', 'Urania-Säule', '6C', 'Gegenüber der Urania bei der Aspernbrücke befindet sich diese nette Stahlsäule. Gut zu klettern, aber ein bisschen hoch!', 'An der Säule anhalten und an der Steinwand steigen. Zwischen erstem und zweitem Podest wirds ein bisschen mulmig...aber das vergeht wenn man einmal oben ist! :-)', 'Power Boulder', 5],
[48.211578,16.383299, 'Urania-Wandl, 5A, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/urania-wandl', 'Urania-Wandl', '5A', 'Die Steinwand ist direkt bei der Urania unter der Aspernbrücke beim Donaukanal...neben dem Badeschiff. Die Steine sind ganz okay zum klettern. Leider nicht so gut wie beim Flax...eher vereinzelte große Griffe. Aber ganz nett um ein bisschen zu Bouldern...mit Seil kann man dann ganz hinauf gehen- das macht auch Spaß!', 'Das Stahlrohr nicht benutzen! Ich weiß es ist verführerisch, aber die Befestigung ist nicht sehr Stabil! Bitte Vorsicht! ...  \n Das Seil kann man am oberen Geländer mit einer Bandschlinge und einem Karabiner befestigen. Das Geländer ist sehr stabil.', 'Stonewalls', 5],
[48.211673,16.383217, 'Nietenstrecker, 5A, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/nietenstrecker', 'Nietenstrecker', '5A', 'Schöner Stahl-Überhang direkt unter der Aspernbrücke bei der Urania.', 'Diese Route sollte man nur mit Seil nehmen! Man kann es leicht mit einer Bandschlinge und einem Karabiner am Geländer befestigen..es hält! :-)', 'Pure Steel', 4],
[48.164988,16.326987, 'Kabelwerkboulder, 6B, Sculptures', 'http://www.urban-boulder.com/de/boulderroute/kabelwerkboulder', 'Kabelwerkboulder', '6B', '3 witzige Pfeiler-Skulpturen aus wunderschönem grünem Marmor. Unmittelbar beim Generationenspielplatz nähe U6 Station Tschertegasse.', 'Keine speziellen Rules. Crashpad empfohlen.', 'Sculptures', 3],
[48.242362202561,16.386807113886, 'Blechsteg, 4, Permalink', 'http://www.urban-boulder.com/de/boulderroute/blechsteg', 'Blechsteg', '4', 'Unter der U6-Brücke auf der Donauinsel gibt es die gleichen Routen wie auf der Handelskai-Seite! ...  \n Aufpassen wegen der Radfahrer!', 'No rules', 'Permalink', 5],
[48.242115,16.386905, 'Untere Südflanke, 4, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/untere-s%C3%BCdflanke', 'Untere Südflanke', '4', 'Gleich neben der "Oberen Südflanke" befindet sich diese Steinwand. Super zum Finger-trainieren!', 'Über die Steinwand auf das obere Niveau...', 'Stonewalls', 2],
[48.242067,16.386806, 'Obere-Südflanke, 2+, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/obere-s%C3%BCdflanke', 'Obere-Südflanke', '2+', 'Gleich bei der U6-Station Handelskai gibts haufenweise Steinwände zum bouldern. Die "Obere-Südflanke" hat eine angenehme Höhe- die man mit Bouldermatte ohne Probleme durchsteigen kann. Die Route ist gleich rechts neben der Fußgängerrampe.', 'Lässiger Abgang beim oberen Geländer ist Pflicht! :-)', 'Stonewalls', 5],
[48.208587,16.386772, 'Zollamtsboulder, 2+, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/zollamtsboulder', 'Zollamtsboulder', '2+', 'Kleine Kletterwand bei U3-Landstraße entdeckt...', 'keine', 'Stonewalls', 3],
[48.244091,16.39018, 'Unterzughangler, 5A, Power Boulder', 'http://www.urban-boulder.com/de/boulderroute/unterzughangler', 'Unterzughangler', '5A', 'Okay...unser lieber Hubert bekommt ein Bier für die Erstbesteigung dieser Route! Prost! ...  \n Am besten kommt man über die U6 Brücke, von der Station Hondelskai dorthin! Die Route ist gleich neben der Fahrradrampe, unter der Schnellbahnbrücke auf der Donauinsel.', 'Als erstes muss man von der Fahrradrampe aus über das Geländer steigen, und den hinteren Unterzug entlang bis zum Betonsockel hangln. Dann gehts weiter, über den Unterzug des Hauptträgers bis zur ersten Querrippe. Dort kann man sich beim Loch ein bisschen ausruhen, bevor man den Aufstieg über die Rippe hinauf bis zum Geländer der Brücke wagt.', 'Power Boulder', 5],
[48.249612,16.40925, 'Mikado, 2, Sculptures', 'http://www.urban-boulder.com/de/boulderroute/mikado', 'Mikado', '2', 'Spielplatz in Floridsdorf', 'naja...spielen halt...:-)', 'Sculptures', 5],
[48.226454,16.349874, 'HausAmGürtel-Rückseite, 2, Buildings', 'http://www.urban-boulder.com/de/boulderroute/hausamg%C3%BCrtel-r%C3%BCckseite', 'HausAmGürtel-Rückseite', '2', 'Auf der Rückseite des Hauses, direkt zwischen den Stadtbahnbögen und dem Gebäude, gibt es ein paar Gesimse zum herumhangln.', 'Bis zum obersten Blech...ohne Hände!', 'Buildings', 5],
[48.234634,16.360678, 'Kletterturm-Spittelau, 4, Training', 'http://www.urban-boulder.com/de/boulderroute/kletterturm-spittelau', 'Kletterturm-Spittelau', '4', 'Es gibt einen neuen 21 Meter-outdoor-Kletterturm in der Nähe der U6-Station Spittelau!  Mit der neuen Park&amp;Ride Anlage Spittelau wurde auch dieser nette Kletterturm errichtet. Das Ganze dort nennt sich Pier 9, und besteht aus dem Kletterturm, einer Openair-Boulderwand, einigen Bars und einem netten Fahrradgeschäft. Der Turm wird vorraussichtlich am 12.10.2009 eröffnet, und vom kletterhallewien-Team betreut. Die Boulderwand ist gratis, und wird es hoffentlich auch bleiben...', 'Immer schön den Trainern folgen!', 'Training', 2],
[48.234513,16.36092, 'Spittelauer Platte, 4, Training', 'http://www.urban-boulder.com/de/boulderroute/spittelauer-platte', 'Spittelauer Platte', '4', 'Neue super Boulderwand in der Nähe der U6 Station Spittelau! ...  \n Das ganze befindet sich gleich neben dem neuen Kletterturm der kletterhallewien, bei der neuen Park&amp;Ride Station Spittelau. Wenn man von der U-Bahnstation Spittelau die lange Rampe in Richtung Donaukanal fähr, kommt man genau daran vorbei. ...  \n Die Platten sind aus Beton, und wiederholen sich alle vier Meter. Jede Platte hat eine andere Neigung und somit einen anderen Schwierigkeitsgrad.Man landet weich in einem Kiesbett.', 'Mit der Schichtung, gegen die Schichtung, gerade oder senkrecht...wie man mag! ...  \n viel Spaß!!!', 'Training', 5],
[48.231286602371,16.361760646105, 'Bogenquetscher, 5A, No type', 'http://www.urban-boulder.com/de/boulderroute/bogenquetscher', 'Bogenquetscher', '5A', 'Noch eine Route am Donaukanal! Höhe Spittelau, neben dem neuen Radweg, der von der Station herunterführt.', 'Zwischen der Säule und dem Ziegelbogen einquetschen, und hochschieben. Sobald mann die Ziegelkante erreicht hat, ist es easy!', 'No type', 5],
[48.22645,16.349819, 'Währinger Gürtelbögen, 4, Buildings', 'http://www.urban-boulder.com/de/boulderroute/w%C3%A4hringer-g%C3%BCrtelb%C3%B6gen', 'Währinger Gürtelbögen', '4', 'durchaus schwierige Route, Ziel ist es das high-score pickerl im obern Fenster zu berühren und wieder heil herunter zu kommen.', 'keine', 'Buildings', 2],
[48.226464,16.350025, 'HausAmGürtel, 4, Buildings', 'http://www.urban-boulder.com/de/boulderroute/hausamg%C3%BCrtel', 'HausAmGürtel', '4', 'Mittel, jedoch sehr schnell sehr hoch! ...  \n ohne Bouldermatte etwas gefährlich. ...  \n großes MINUS reger Verkehr !!! ...  \n großes PLUS am Gürtel bleibt man Abends nicht stehen', 'heil wieder runter kommen', 'Buildings', 4],
[52.243151,21.024715, 'Warschau-Bibliothek, 2, Fun Stuff', 'http://www.urban-boulder.com/de/boulderroute/warschau-bibliothek', 'Warschau-Bibliothek', '2', 'Die neue Bibliothek der Hauptuni in Warschau ist wie fürs klettern gemacht! Angeblich ist der Architekt selbst Kletterer...:-)', 'Nach Warschau fahren und ansehen! Ist wirklich ein tolles Gebäude mit frei begehbarem Dachgarten!', 'Fun Stuff', 5],
[48.131076,16.25291, 'Feserl-Überhang, 5A, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/feserl-%C3%BCberhang', 'Feserl-Überhang', '5A', 'Dieser Überhang an der Mizzi-Langer-Wand ist sicherlich ein Highlight.  Von Wien aus kommt man am besten mit dem 60A, von der Station Liesing aus, dort hin. Man steigt bei der Station Willergasse-Schule aus, und geht dann die schmale Willergasse hinauf zur Kirche. Dort kommt man auch bei der Klagemauer vorbei. Nach der Kirche gehts an einem Parkplatz vorbei, dann noch kurz geradeaus durch ein Waldstück, und schon ist man bei der berühmten Mizzi-Langer-Wand! Dort gibt es einiges zum Bouldern, aber auch 16 gebohrte Routen zum Top-Rope klettern. Viel Spaß!', 'In der Topo von <a href="http://www.bergsteigen.at">www.bergsteigen.at</a> ist es die Route 7-Feserl-Überhang. Vom Schwierigkeitsgrad her schreiben sie...ab 5, das ist aber sicherlich die leichtere Variante... ...  \n Wenn man den Überhang direkt nimmt, ist er sicherlich um einiges schwieriger. Am besten selber ausprobieren!', 'Stonewalls', 5],
[48.132789,16.25652, 'Klagemauer, 5A, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/klagemauer', 'Klagemauer', '5A', 'Marschiert man von der 60A Station Willergasse-Schule in Richtung Mizzi-Langer-Wand, kommt man direkt an dieser Klostermauer, unterhalb der Kirche, vorbei. ...  \n Die Griffe, und vor allem die Fugen, sind sehr sandig und bröseln leicht ab. Die Wand ist neben der Rampe, die rechts hinauf zur Kirche führt, am besten. ...  \n Wenn man möchte kann man dort auch top-ropen! Oben, im Klostergarten, steht ein kleiner Baum, um den man das Seil werfen kann.', 'Es empfiehlt sich dort eher bei Nacht zu klettern, da dann auf der vorbeilaufenden Straße kaum was los ist. Sonst muss man damit rechnen, dass man von aufgebrachten Nonnen verscheucht wird...:-)', 'Stonewalls', 5],
[48.15128,16.399055, 'Kurwand Oberlaa, 2, Training', 'http://www.urban-boulder.com/de/boulderroute/kurwand-oberlaa', 'Kurwand Oberlaa', '2', 'Den wellnessbewussten Kletterern unter euch empfehlen wir eine Behandlung an der Kurwand Oberlaa. Die Behandlung orientiert sich an ganzheitlichen Therapiemethoden, und beinhaltet neben einer Steigerung des körperlichen und geistigen Wohlbefindens auch ein spezielles Fingerkuppen-peeling. Diese besondere Zusammensetzung und Oberfläche der Klettergriffe, ist nur hier, im Kurpark Oberlaa zu finden!', 'Es gibt dort markierte Routen. In der Bilderserie verfolgen wir den orangen Kurlehrgang. Wir sind schon auf weitere interessante Markierungen gespannt!', 'Training', 5],
[48.150193,16.398583, 'Atomium, 2+, Training', 'http://www.urban-boulder.com/de/boulderroute/atomium', 'Atomium', '2+', 'Im Kurpark Oberlaa steht dieses tolle Sportgerät, gleich in der Nähe des Ziegelturms im Kurpark Oberlaa. ...  \n Chemiker würden es vermutlich eher Molekül(ium) nennen, aber so genau nehmen wir es ja nicht... ...  \n Die steile Seite ist ganz nett, und eignet sich gut zu üben von leichten Überhängen.', 'Eine nicht einfache Variante beginnt bei den untersten Griffen, also eigentlich mit dem Hintern am Boden, und führt dann über den Überhang direkt nach oben...den Kids wird noch ein bisschen geholfen, die Großen müssen alleine rauf!', 'Training', 5],
[48.194747,16.340873, 'Bürgerspital, 2+, Buildings', 'http://www.urban-boulder.com/de/boulderroute/b%C3%BCrgerspital', 'Bürgerspital', '2+', 'Erste buildering-Versuche. ...  \n Aufpassen! Das Gebäude ist ein Hotel-d.h. Rund um die Uhr Betrieb!', 'Lasst euch nicht erwischen!', 'Buildings', 5],
[48.21273,16.399561, 'Boulderturm-Hauptallee, 2, Training', 'http://www.urban-boulder.com/de/boulderroute/boulderturm-hauptallee', 'Boulderturm-Hauptallee', '2', 'Direkt neben dem Skatepark bei der Prater-Hauptallee befindet sich ein kleiner Boulderturm. Dieser ist leider nicht im besten Zustand; einige Griffe sind nicht mehr fest, oder fehlen ganz, aber trotzdem ganz gut zum Üben geeignet.', '---', 'Training', 3],
[48.245507,16.381589, 'Klettergriffe, 2+, Training', 'http://www.urban-boulder.com/de/boulderroute/klettergriffe', 'Klettergriffe', '2+', 'Wie im Forum Gipfeltreffen auf <a href="http://www.gipfeltreffen.at">www.gipfeltreffen.at</a> unter der Rubrik "Interessante Kletterplätze in Wien" gelesen, gibt es bei der Floridsdorferbrücke eine künstliche Kletterwand. Sie befindet sich rechts der Brücke, auf der Seite des 20.Bezirks. Es sind dort meist wenig Leute, da die Wand im Park etwas versteckt liegt, und dort wenige Passanten unterwegs sind. ...  \n Die Griffe sind angenehm zu greifen und auch noch schön griffig. Beste Vorraussetzungen zum Technik üben! Die Wand ist ungefähr 10m lang, und man landet angenehm in einem Kiesbett.', 'Oberhalb der Griffe ist die Kante der Floridsdorfer Brücke, ungefähr 1m über dem letzten Griff. Dort kann man Dynamos üben!', 'Training', 4],
[48.242864,16.385829, 'Handelskai-Dachl, 4, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/handelskai-dachl', 'Handelskai-Dachl', '4', 'Beim Spielplatz zwischen der U6-Brücke und der Floridsdorferbrücke ist diese Schmankerl zu finden! Auf einer Seite ist zwar eine Umzäunung mit Stacheldraht (Vorsicht!). Auf der anderen Seite hat uns die Stadt sogar eine Sandkiste unter der Route angelegt, damit wir uns beim Abstieg nicht verletzen! wie nett! ...  \n Also bitte nicht bei regem Spielplatzbetrieb kletern!!!', 'Anfangen bei der Säule, hochklettern bis zum Unterzug, dann den Unterzug bis ans Ende vorhankeln, und auf die Oberkante hochschnappen. Die Kante kann man super greifen! Ja und dann nach oben aufs Gründach...', 'Pure Steel', 5],
[48.150577,16.398369, 'Ziegelturm, 4, Sculptures', 'http://www.urban-boulder.com/de/boulderroute/ziegelturm', 'Ziegelturm', '4', 'Was im Kurpark Oberlaa alles so rumsteht... ;) ...  \n Desöfteren wurden von mir hier schon Boulderer gesichtet. Aufpassen muss man allerdings auf der Rückseite des Turms, da gibt es ein paar ungünstige Eisenstangen in Bodennähe (Verletzungsgefahr).', 'keine', 'Sculptures', 3],
[48.218811,16.370873, 'Flex, 4, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/flex', 'Flex', '4', 'Spät aber doch haben wir uns mal entschieden uns Richtung Flex zu bewegen, um dort den wahrscheinlich bekanntesten Boulder-Spot Wiens zu probieren.', 'keine', 'Stonewalls', 5],
[48.321326,16.066909, 'Tullner Dachl, 2+, Fun Stuff', 'http://www.urban-boulder.com/de/boulderroute/tullner-dachl', 'Tullner Dachl', '2+', 'Nach einer feucht-fröhlichen Feier klettert sichs in Tulln am besten!', 'Alle müssen rauf...alle Mittel sind erlaubt! :-)', 'Fun Stuff', 5],
[48.234657,16.413429, 'Austria Center, 6C, Sculptures', 'http://www.urban-boulder.com/de/boulderroute/austria-center', 'Austria Center', '6C', 'Nimm was du kriegen kannst!', 'Nimm was du kriegen kannst!', 'Sculptures', 1],
[48.2347,16.413184, 'Austria Center-Brasilien, 5A, Sculptures', 'http://www.urban-boulder.com/de/boulderroute/austria-center-brasilien', 'Austria Center-Brasilien', '5A', 'Dieser Boulder geht stark auf die Unterarme, da man kaum gut Tritte findet. Nur an den Ecken des Boulder gibt es Stellen zum ausrasten. Schuhe und Magnesium mitnehmen! ...  \n Es wurden dort angeblich schon Kletterer von Sicherheitsmaxln verscheucht! Also vielleicht nicht gerade dann klettern gehen, wenn gerade ein Kongress oder eine Ausstellung stattfindet! Diesen Sonntag wars jedenfalls angenehm ruhig...', 'Möglichst viele Umrundungen entlang des horizontalen Risses...bis einem schwindlich wird! :-)', 'Sculptures', 3],
[48.234596,16.413187, 'Austria Center-Marokko, 5A, Sculptures', 'http://www.urban-boulder.com/de/boulderroute/austria-center-marokko', 'Austria Center-Marokko', '5A', 'Der Stein aus Marokko: ...  \n Dieser Boulder ist von den fünf Steinen einer der leichteren. Er ist teilweise leicht angelegt, was die Sache etwas vereinfacht. ...  \n Kletterschuhe und Magnesium nicht vergessen! Die Griffe sind etwas rutschig, die Tritte oft sehr klein. ...  \n Wer eine Rund schafft krigt ein Bier!', 'Auf der Südseite kann man eigentlich nur die Bruchkante entlangklettern- auf der Nordseite sollte man auf den Riss verzichten, und nur die natürlichen Griffe benutzen!', 'Sculptures', 2],
[48.237233,16.40703, 'Donaupark, 2+, Sculptures', 'http://www.urban-boulder.com/de/boulderroute/donaupark', 'Donaupark', '2+', 'Die Statue ist  etwa 4 meter hoch, und eher einfach zu besteigen. Der Stein ist jedoch sehr rauh, weshalb Handschuhe sicher kein Fehler sind.', 'Nimmt man nur die halbrunden Ausnehmungen, wird die Sache schon etwas interesanter!', 'Sculptures', 3],
[48.233204,16.409824, 'Stahldach, 2, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/stahldach', 'Stahldach', '2', 'Stahlkonstruktion zum herumhangln', 'none', 'Pure Steel', 1],
[48.236323,16.411872, 'Ramp, 2+, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/ramp', 'Ramp', '2+', 'Kleine Hanglübung', 'no rules', 'Pure Steel', 5],
[48.236117,16.412279, 'Top-down, 2+, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/top-down', 'Top-down', '2+', 'Die Stahlstiegen einmal anders hinauf!', 'Nicht auf die Finger steigen lassen.', 'Pure Steel', 5],
[53.733388,21.709199, 'Masurischer Hanglbaum, 2, Trees', 'http://www.urban-boulder.com/de/boulderroute/masurischer-hanglbaum', 'Masurischer Hanglbaum', '2', 'Beim Segeln auf den Masuren in Polen entdeckt...ein echtes Schmankerl!', 'Man beachte die glatten, brustförmigen Griffe! Schöne Aufleger!', 'Trees', 5],
[8.656633,-77.366066, 'Palmera, 2, Trees', 'http://www.urban-boulder.com/de/boulderroute/palmera', 'Palmera', '2', 'Beim Urlaub in Kolumbien wurde an einem verlassenen Strand die perfekte Kletterpalme entdeckt, und natürlich sofort bestiegen! :-)', 'No rules...just relax and enjoy the sun!!!', 'Trees', 4],
[48.24504,16.392881, 'Schwingerklub, 4, Other Stuff', 'http://www.urban-boulder.com/de/boulderroute/schwingerklub', 'Schwingerklub', '4', 'In unregelmäßigen Abständen wird vom wiener Schwingerclub die floridsdorfer Volksschaukel in Betrieb genommen. Eine sehr witzige, aber auch furchteinflößend große Schaukel, die an der Unterseite der U6 Brücke, in der nähe der Station Neue Donau, montiert wird. Man lässt sich von den erfahrenen Kollegen bis an die Unterseite der Brücke hochziehen, lässt auf Kommando los, und saust dann, einen halben Meter über der Wasseroberfläche, zur anderen Seite der Brücke. ...  \n Der Abstieg ist individuell zu gestalten. ... ', '1. Nie ins, vor allem nicht ins unbekannte Wasser springen. Schon gar nicht mit einem Kopfsprung. ...  \n        2. Schwimme in kleineren Seen wo das Ufer naturgemäß nah, ist  sind leicht zu erreichen und der Ausstieg ohne weiteres möglich. ...  \n        3. Meide Gewässer in denen Surfer, Motor- / Segelboote und dgl. vorkommen, die Unfallgefahr ist zu groß. ...  \n        4. Helle knallige Badeanzüge &amp; Schwimmkappen helfen, dass man besser beachtet wird. ...  \n        5. Aufblasbare Matratzen und Flügelchen für Kinder bieten letztlich keine Sicherheit. ...  \n        6. Ohne Begleitung kein Schwimmen im offenen Gewässer. ...  \n        7. Pro Kind solle immer ein Erwachsener mitschwimmen. Dabei In tiefen Gewässern Schwimmweste mit festen Schwimmkörpern verwenden, um das Abschleppen für den Notfall zu erleichtern. ...  \n        8. Um einen Sonnenbrand zu vermeiden sollte ein T-Shirt, wasserfeste sonnencreme oder besser ein Ganzkörperanzug verwendet werden. Das Wasser wirkt wie ein Brennglas und verstärkt die Sonne mehrfach.', 'Other Stuff', 5],
[48.231069300774,16.361894756556, 'Kanalzange, 4, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/kanalzange', 'Kanalzange', '4', 'Entlang der Donaukanalverbauung, Höhe Spittelau/ Müllverbrennung, gibt es jede menge Möglichkeiten zu klettern. Die Säulen sind teilweise ausgebrochen, sodass man an einigen Stellen gut greifen kann. Die Höhe verläuft mit der Rampe, sodass man sich langsam steigern kann. ...  \n Das Ganze befindet sich in der Nähe des neuen Zaha Hadid Hauses (das Weiße verwinkelte) am Donaukanal. Man kommt am besten von der U-Bahnstation Spittlelau hin.', 'Die Säulen an den Kanten klammern, und sich was für die Füße suchen. Dann Stück für Stück nach oben arbeiten! Oben am Kapitell gibts noch einen schönen Aufleger, bevor man das Geländer greifen kann.', 'Stonewalls', 5],
[48.228147,16.409603, 'Pfeiler Donauinsel, 2+, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/pfeiler-donauinsel', 'Pfeiler Donauinsel', '2+', 'Die Pfeiler der Reichsbrücke sind mit griffigen Granitsteinplatten verkleidet. Es lässt sich dor gut boulder, auch wenn es an manchen Stellen von der Brückenentwässerung ständig nass ist, und auch etwas streng riecht...Trotzdem ein gutes Fingertraining!', 'Just for fun!', 'Stonewalls', 2],
[48.226424,16.405541, 'Reichsbrückenschnecke, 10, Fun Stuff', 'http://www.urban-boulder.com/de/boulderroute/reichsbr%C3%BCckenschnecke', 'Reichsbrückenschnecke', '10', 'Die Stahlkonstruktion ist ganz witzig zu besteigen, auch wenn man schon müde ist. ...  \n Man kann von oben, vielleicht mit einem Bier, die nette Aussicht über die Donau genießen! ...  \n Zugang über die U1 Station Vorgartenstraße.', 'Besser mit Handschuhen...die Teile sind ganz schön scharf!', 'Fun Stuff', 3],
[48.24224,16.386838, 'Hubertus Steg, 6C, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/hubertus-steg', 'Hubertus Steg', '6C', 'Diese Route befindet sich direkt unterhalb des Fußgängerstegs.', 'Man hält sich ganz gemütlich auf dem 5cm Vorsprung beim Stahlträger, und versucht mit ein bisschen Schwung den oberen Träger zu greifen. Gar nicht so leicht...nicht ohne Rückensicherung!', 'Pure Steel', 5],
[48.242142,16.386796, 'Wendeltreppenboulder, 4, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/wendeltreppenboulder', 'Wendeltreppenboulder', '4', 'Die Stufen sind schön griffig! Einfach so weit man kommt hinaufhangln...Lasst euch nur nicht auf die Finger steigen!', 'Den Fuß kann man schön auf dem äußeren Träger auflegen. Für die Harten ohne Füße! :-)', 'Pure Steel', 4],
[48.234854,16.355512, 'Bieriger Boulder, 4, Stonewalls', 'http://www.urban-boulder.com/de/boulderroute/bieriger-boulder', 'Bieriger Boulder', '4', 'Der Boulder befindet sich im Innenhof des neuen Skyoffice Gebäudes, schräg gegenüber vom Brandauers Bierigen, wo man nach dem Klettern sehr nett bei einem Bier über die neuen Boulder Routen plaudern kann! :-)', 'Links stehen zwei rostige Stahlteile aus der Wand-Vorsicht! Nur die Steinecke und die obere Betonkante verwenden.', 'Stonewalls', 4],
[48.186612,16.3372, 'Wienzeilendachl, 2, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/wienzeilendachl', 'Wienzeilendachl', '2', 'Die näheste U-Bahnstation ist U4 Längenfeldgasse. In der Nähe der Basketballplätze gibt es einiges zum austoben! ...  \n Das Dach ist dabei eine eher leichte Übung. Trotzdem sind Handschuhe und griffige Schuhe von Vorteil! ...  \n Anstatt nur raufzuklettern, kann man versuchen sich an der Unterseite des Dachs hochzuarbeiten.', 'nicht runterfallen!', 'Pure Steel', 4],
[48.218728,16.370966, 'Flex-Hanglbaum, 2+, Trees', 'http://www.urban-boulder.com/de/boulderroute/flex-hanglbaum', 'Flex-Hanglbaum', '2+', 'Der schräge Ast eignet sich perfekt zum hockhangln. Die Rinde ist sehr griffig, und am oberen Enden gibt es eine Astgabelung, wo man vor dem Abstieg ein bisschen verschnaufen kann.', 'Without Feet!', 'Trees', 5],
[48.186295,16.3368, 'Trasse Anderst, 2, Fun Stuff', 'http://www.urban-boulder.com/de/boulderroute/trasse-anderst', 'Trasse Anderst', '2', 'selbsterklärend', 'An verschiedensten Stellen raufkommen, Handschuhe empfehlenswert, da das Alu etwas verdreckt ist. ...  \n Leider hoher Gestank aufgrund der "Plastik-toilette".', 'Fun Stuff', 4],
[48.189609,16.33958, 'Fritz- Imhoff- DachL, 2, Fun Stuff', 'http://www.urban-boulder.com/de/boulderroute/fritz-imhoff-dachl', 'Fritz- Imhoff- DachL', '2', 'eine nette aufwärm Runde bevor man bouldern geht, mit Handschuhen ist \' s auch etwas einfacher. ...  \n Übrigends gibt \' s Handschuhe (MaxiFlex plus) ab jetzt beim "pipe"!', '1. rauf! + Holz ab Schulterhöhe berühren, ...  \n 2. rauf + am Träger rüber und wieder runter, ...  \n   und, und, und,...', 'Fun Stuff', 3],
[48.226217,16.396151, 'Piraterlwald, 2+, Fun Stuff', 'http://www.urban-boulder.com/de/boulderroute/piraterlwald', 'Piraterlwald', '2+', 'Die orangen Säulen sind sehr rutschig, und gerade so dick, dass man sie nicht vernünftig fassen kann. Deshalb haben wir dann bald unsere eigene Technik entwickelt. Eigentlich Zirkusreif!', 'Handschuhe sind sehr empfehlenswert! Man hat damit besseren Halt, und beim Abstieg verbrennt man sich nicht so leicht.', 'Fun Stuff', 5],
[48.195116,16.341788, 'Gerüst-action, 2+, Fun Stuff', 'http://www.urban-boulder.com/de/boulderroute/ger%C3%BCst-action', 'Gerüst-action', '2+', 'Eine kleine Hanglübung zum aufwärmen...', 'feetless...', 'Fun Stuff', 5],
[48.207648,16.310647, 'Ottakringer Nase, 5A, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/ottakringer-nase', 'Ottakringer Nase', '5A', 'Die Route ist direkt unter der Spetterbrücke, zwischen den Stationen Ottakring und Kendlerstraße. Extrem witzig!!!', 'Rauf, rauf, rauf!', 'Pure Steel', 5],
[48.242262,16.386762, 'U6-Brücke Handelskai, 4, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/u6-br%C3%BCcke-handelskai', 'U6-Brücke Handelskai', '4', 'Die Route ist unter der U6-Brücke auf der rechten Seite direkt unter dem Gehsteig der Brücke.', 'Handschuhe empfehlenswert! ...  \n Ohne Türschnalle!', 'Pure Steel', 3],
[48.23617,16.356365, 'Skywalk-Stütze, 6B, Power Boulder', 'http://www.urban-boulder.com/de/boulderroute/skywalk-st%C3%BCtze', 'Skywalk-Stütze', '6B', 'Unter der neuen Fußgängerbrücke dem "Skywalk" bei der Station Spittelau gibt es einiges zum austoben. Das Highlight ist sicher die schräge Betonstütze die man am ehesten schafft, wenn man sich auf einen der beiden kleinen Pfeiler stellt. Die Route ist nicht ohne!', 'Die beiden Straßenpoller dürfen verwendet werden. Die Laterne links neben der Säule nicht! Auch das Schild direkt an der Betonsäule nur zum Führen!', 'Power Boulder', 4],
[48.241926,16.386323, 'Handelskai-Zieher, 4, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/handelskai-zieher', 'Handelskai-Zieher', '4', 'Die Rout ist in der Nähe der U6 Station Handelskai. Wenn man aus der Station kommt gleich rechts! Die Route geht bis zum Fachwerksträger hinauf.', 'Die dicke Betonsäule darf verwendet werden. Kamintechnik bis zum Stahl- Fachwerksträger, und dann hochziehen! Aufpassen beim Abstieg!', 'Pure Steel', 4],
[48.208146,16.31062, 'Anderlsteig, 4, Pure Steel', 'http://www.urban-boulder.com/de/boulderroute/anderlsteig', 'Anderlsteig', '4', 'Das ist der berühmte Anderlsteig in Ottakring wo schon viele Kletterer ihre Unschuld verlohren haben...Perfekt für Anfänger um ein bisschen Kraft aufzubauen!', 'Die Stiegen an der Unterseite bis zum I-Träger, und dann an der Außenseite entlang bis zur äußeren Kante. Zum schluss noch hochziehen und auf das Geländer schnappen...', 'Pure Steel', 5]
];
